r\nYou may log in to the member area at the following URL:\r\n\r\n{login_link}\r\n\r\nThank You,\r\n\r\nCupertino Tennis Club\";s:32:\"reg-prompt-complete-mail-subject\";s:26:\"Complete your registration\";s:29:\"reg-prompt-complete-mail-body\";s:154:\"Dear {first_name} {last_name}\r\n\r\nThank you for joining us!\r\n\r\nPlease complete your registration by visiting the following link:\r\n\r\n{reg_link}\r\n\r\nThank You\";s:29:\"upgrade-complete-mail-subject\";s:31:\"CTC - Membership Status Changed\";s:26:\"upgrade-complete-mail-body\";s:1077:\"Dear {first_name} {last_name}\r\n\r\nWelcome to the Cupertino Tennis Club! Your membership is paid until December 31, 2021.\r\n\r\nThe Cupertino Tennis Club (CTC) is co-sponsored by the City of Cupertino and is open to residents and non-residents.  CTC sponsors  USTA tennis teams (USTA NorCal Leagues), Interclub, and social events.  The Cupertino Sports Center (CSC)  is the location for league play and other events.  You must have an ANNUAL (not monthly)  membership at CSC and be a current member of CTC prior to playing on a CTC USTA or Interclub team.\r\n\r\nCome on out to CSC and play some tennis.\r\n\r\nDECLARE INTENT to play and join a Cupertino Tennis Team to play in a USTA League.\r\nParticipate in Womens Interclub.\r\nPlay mens drop-in tennis MWF at 1:00 PM.\r\nWatch for CTC Socials (coming soon)\r\nPlay drop-in tennis Friday nights 6:45 PM.\r\nVolunteer for one or more of the club\'s activities -- a great way to meet new people and have a good time!\r\n\r\nQuestions: \r\nContact John Sperinde at  Membership@CupertinoTennisClub.org\r\n\r\nThank You,\r\n\r\nCupertino Tennis Club Team\";s:18:\"reset-mail-subject\";s:35:\"Cupertino Tennis Club: New Password\";s:15:\"reset-mail-body\";s:261:\"Dear {first_name} {last_name}\r\n\r\nHere is your new password:\r\n\r\nUser name: {user_name}\r\nPassword: {password}\r\n\r\nYou can change the password you want from the Edit Profile page of the site (after you log into the site).\r\n\r\nThank You,\r\n\r\nCupertino Tennis Club Team\";s:28:\"account-change-email-subject\";s:16:\"Account Updated!\";s:25:\"account-change-email-body\";s:150:\"Dear {first_name} {last_name},\n\n Your account status has been updated! Please login to the member area at the following URL:\n\n {login_link}\n\nThank You\";s:10:\"email-from\";s:57:\"Cupertino Tennis Club <Webmaster@CupertinoTennisClub.org>\";s:19:\"swpm-active-version\";s:5:\"3.7.7\";s:13:\"hide-adminbar\";s:27:\"checked=&#039;checked&#039;\";s:18:\"protect-everything\";s:0:\"\";s:22:\"enable-free-membership\";s:27:\"checked=&#039;checked&#039;\";s:14:\"enable-moretag\";s:0:\"\";s:12:\"enable-debug\";s:0:\"\";s:22:\"enable-sandbox-testing\";s:0:\"\";s:22:\"allow-account-deletion\";s:27:\"checked=&#039;checked&#039;\";s:18:\"free-membership-id\";i:2;s:22:\"default-account-status\";s:6:\"active\";s:25:\"swpm-addon-enable-captcha\";s:17:\"checked=\'checked\'\";s:36:\"swpm-addon-google-recaptcha-site-key\";s:40:\"6Leo8wsTAAAAAOoX-4RRIZzXUwPPEy2NTBQDYlOB\";s:38:\"swpm-addon-google-recaptcha-secret-key\";s:40:\"6Leo8wsTAAAAAGRTc8KvxVbuaFgA71uwfF7ZElUH\";s:28:\"enable-expired-account-login\";s:27:\"checked=&#039;checked&#039;\";s:35:\"enable-admin-notification-after-reg\";s:27:\"checked=&#039;checked&#039;\";s:24:\"admin-notification-email\";s:22:\"ctccupertino@gmail.com\";s:41:\"enable-notification-after-manual-user-add\";s:0:\"\";s:28:\"reg-complete-mail-body-admin\";s:0:\"\";s:33:\"bulk-activate-notify-mail-subject\";s:0:\"\";s:30:\"bulk-activate-notify-mail-body\";s:0:\"\";s:24:\"show-adminbar-admin-only\";s:0:\"\";s:30:\"disable-access-to-wp-dashboard\";s:0:\"\";s:24:\"members-login-to-comment\";s:0:\"\";s:31:\"reg-complete-mail-subject-admin\";s:0:\"\";s:29:\"email-activation-mail-subject\";s:40:\"Action Required to Activate Your Account\";s:26:\"email-activation-mail-body\";s:182:\"Dear {first_name}\r\n\r\nThank you for registering. To activate your account, please click on the following link (this will co