d in filling an open position, or if you have questions regarding a position for next year on the board.\r\n\r\n</div>\r\n</div>','board','','publish','closed','closed','','board','','','2020-12-30 17:12:14','2020-12-31 01:12:14','',27,'http://ctc.cupertinotennisclub.org/?page_id=17',0,'page','',0),(18,1,'2015-08-24 19:00:23','2015-08-24 19:00:23','here will be the board','board','','inherit','closed','closed','','17-revision-v1','','','2015-08-24 19:00:23','2015-08-24 19:00:23','',17,'http://ctc.cupertinotennisclub.org/index.php/2015/08/24/17-revision-v1/',0,'revision','',0),(19,31,'2015-08-24 19:05:44','2015-08-24 19:05:44','<div class=\"col-xs-12 col-md-12\">\r\n<ul>\r\n<li><p> If you need to contact Board Members, please click <a href=\"http://ctc.cupertinotennisclub.org/about/board/\"> here. </a></p></li>\r\n<li><p> If you have questions regarding Cupertino Sports Center (membership, court rental, facilities or activities), please call the CSC directly (408-777-3160) or inquire at the front desk.  (Note that CTC and CSC have separate memberships.  Both are required for League play.)</p></li>\r\n<li><p> If you\'re interested in tennis lessons for yourself or your family members, please contact Lifetime Tennis Cupertino following the link <a href=\"https://www.lifetimeactivities.com/cupertino/\">here. </a></p></li>\r\n<li><p>If you have other questions, please fill out the contact form below. </p></li>\r\n</ul>\r\n           		    \r\n[contactformgenerator id=\"1\"]\r\n\r\n\r\n              </div>','contact','','publish','closed','closed','','contact','','','2020-02-05 18:54:54','2020-02-06 02:54:54','',0,'http://ctc.cupertinotennisclub.org/?page_id=19',0,'page','',0),(20,1,'2015-08-24 19:05:44','2015-08-24 19:05:44','Contact us','contact','','inherit','closed','closed','','19-revision-v1','','','2015-08-24 19:05:44','2015-08-24 19:05:44','',19,'http://ctc.cupertinotennisclub.org/index.php/2015/08/24/19-revision-v1/',0,'revision','',0),(21,1,'2015-08-24 19:17:07'