ng> - the physical Tennis Courts. </p>\r\n              <p> <strong> Cupertino Tennis Club (CTC)</strong> - for Interclub and USTA league activities. </p>\r\n              <p> <strong>*</strong> If you will be playing in the USTA League or in the Womens Interclub League, you must be both an annual passholder at the CSC (the courts) and also a member of the Cupertino Tennis Club (this application), before you may play in any match. The CSC membership may be obtained at the front desk. </p>\r\n\r\n           		<ul class=\"front-page-list\"> \r\n<p> <strong> Annual Dues:</strong> </p>\r\n              <li> $20 Resident </li>\r\n              <li> $25 Non-resident </li>\r\n              </ul> \r\n\r\n              <p> Memberships in CTC are for the calendar year ending December 31st. Therefore, before participating in either of these leagues in the new calendar year beginning in January, you will need to renew your CTC membership. </p> \r\n              <p> To Join the Cupertino Tennis Club, click below to complete the online Membership Application. </p>\r\n              \r\n              \r\n              <div class=\"application\">\r\n                  <a class=\"btn btn-success\" href=\"http://ctc.cupertinotennisclub.org/membership-join/membership-registration/\">ONLINE APPLICATION</a>\r\n              </div>\r\n\r\n              <p> For more information, please send email to John Sperinde at <a href=\"mailto:membership@cupertinotennisclub.org\">Membership</a>. </p>\r\n           			</div>\r\n\r\n           		</div>','membership','','publish','closed','closed','','membership','','','2015-11-24 21:42:45','2015-11-25 04:42:45','',0,'http://ctc.cupertinotennisclub.org/?page_id=35',0,'page','',0),(36,1,'2015-08-24 20:39:31','2015-08-24 20:39:31','Membership here','membership','','inherit','closed','closed','','35-revision-v1','','','2015-08-24 20:39:31','2015-08-24 20:39:31','',35,'http://ctc.cupertinotennisclub.org/index.php/2015/08/24/35-revision-v1/',0,'revision','',0),(37,1,'2015-08-24 20:39:51','2015-08-24 20:39:51','tennis courts','tennis courts','','publish','closed','closed','','tennis-courts','','','2015-08-24 20:39:51','2015-08-24 20:39:51','',0,'http://ctc.cupertinotennisclub.org/?page_id=37',0,'page','',0),(38,1,'2015-08-24 20:39:51','2015-08-24 20:39:51','tennis courts','tennis courts','','inherit','closed','closed','','37-revision-v1','','','2015-08-24 20:39:51','2015-08-24 20:39:51','',37,'http://ctc.cupertinotennisclub.org/index.php/2015/08/24/37-revision-v1/',0,'revision','',0),(39,1,'2015-08-24 20:40:16','2015-08-24 20:40:16','<div class=\"col-md-8\">\r\n<h1> Cupertino Sports Center </h1>\r\n<p> The Cupertino Sports Center (CSC) is operated by the City of Cupertino and is located at the corner of Stevens Creek Boulevard and N. Stelling Road.</p>\r\n\r\n<h4> The Tennis Facility Features: </h4>\r\n<ul class=\"front-page-list\">\r\n              <li>17 tennis courts (12 lighted).</li>\r\n              <li>2 Ball machine courts</li>\r\n              <li>Resident tennis Professionals offering private and group lessons</li>\r\n              <li>Complete locker room facilities</li>\r\n              <li>A child watch while you are playing tennis</li>\r\n              <li>Full service pro shop by LifeTime Tennis</li>\r\n              \r\n</ul>\r\n\r\n<h4> The Sports Facility Features: </h4>\r\n<ul class=\"front-page-list\">\r\n<li>Cardio and wellness classes including aerobics, step aerobics, pilates, yoga, body sculpting and circuit training</li>\r\n              <li>A fitness center (including Cybex weigh stations, free weights, Stairmasters, Lifecycles, and Lifestride treadmill)</li>\r\n              <li>Complete locker room facilities</li>\r\n              <li>Basketball, table tennis, badminton, handball, racquetball and pickle ball</li>\r\n              <li>A Teen Center</li>\r\n              <li>Personal Training Instructors</li>\r\n</ul>\r\n\r\n</div>\r\n\r\n<div class=\"col-xs-12 col-md-4 sidetext\">\r\n              <div class=\"alert alert-info\" role=\"alert\">HOURS</div>\r\n                <p> Mon-Fri: 6:00am - 10.00pm </p>\r\n                <p>Sat: 8:00 am - 10.00 pm </p>\r\n                <p>Sun: 8:00 am - 8:00 pm </p>\r\n\r\n</div>\r\n\r\n<div class=\"col-md-4\">\r\n                <div class=\"alert alert-info\" role=\"alert\">ADDRESS</div>\r\n                <p>Cupertino Sports Center\r\n                </p>\r\n                <p>21111 Stevens Creek Boulevard\r\n                </p>\r\n                <p>Cupertino, California 95014\r\n                </p>\r\n                <p> (408) 777-31-60 </p>\r\n</div>\r\n','facility','','publish','closed','closed','','facility','','','2015-08-25 00:24:46','2015-08-25 00:24:46','',37,'http://ctc.cupertinotennisclub.org/?page_id=39',0,'page','',0),(40,1,'2015-08-24 20:40:16','2015-08-24 20:40:16','Facility/Location here','facility','','inherit','closed','closed','','39-revision-v1','','','2015-08-24 20:40:16','2015-08-24 20:40:16','',39,'http://ctc.cupertinotennisclub.org/index.php/2015/08/24/39-revision-v1/',0,'revision','',0),(41,1,'2015-08-24 20:40:42','2015-08-24 20:40:42','court alerts','court alerts','','publish','closed','closed','','court-alerts','','','2015-08-24 20:40:42','2015-08-24 20:40:42','',37,'http://ctc.cupertinotennisclub.org/?page_id=41',0,'page','',0),(42,1,'2015-08-24 20:40:42','2015-08-24 20:40:42','court alerts','court alerts','','inherit','closed','closed','','41-revision-v1','','','2015-08-24 20:40:42','2015-08-24 20:40:42','',41,'http://ctc.cupertinotennisclub.org/index.php/2015/08/24/41-revision-v1/',0,'revision','',0),(43,1,'2015-08-24 20:41:01','2015-08-24 20:41:01','<div class=\"col-xs-12 col-md-12\">\r\n<h1> Tennis Lessons. Used Tennis balls. </h1>\r\n<img src=\"http://ctc.cupertinotennisclub.org/wp-content/uploads/2015/08/tennislessons1-300x225.jpg\" alt=\"tennislessons\" class=\"img-responsive thumbnail pull-left lessonsimg\" />\r\n<p> Resident tennis Professionals offering private and group lessons. </p>\r\n<p> Registration for tennis classes is available at the Sports Center, Quinlan Community Center, and <a href=\"https://online.activenetwork.com/cupertino/Start/Start.asp\" target=\"_blank\">on-line</a>. For registration information call the Quinlan Community Center at (408)-777-3120. </p>\r\n<p> There are two Ball Machine courts. You can book it <a href=\"https://lt.clubautomation.com/\" target=\"_blank\">on-line</a>. To cancel Ball Machine Reservations, please call 408-777-3169 as there is currently no option to cancel online. </p>\r\n\r\n<p> There is a Full service pro shop by LifeTime Tennis at the Sports Center. </p>\r\n\r\n<p> There is a tennis balls donation program at the Sports Center. You can always exchange 25 used tennis balls for a new Wilson tennis can. </p>\r\n</div>','lessons','','publish','closed','closed','','lessons','','','2015-08-26 00:07:50','2015-08-26 00:07:50','',37,'http://ctc.cupertinotennisclub.org/?page_id=43',0,'page','',0),(44,1,'2015-08-24 20:41:01','2015-08-24 20:41:01','lessons/balls','lessons','','inherit','closed','closed','','43-revision-v1','','','2015-08-24 20:41:01','2015-08-24 20:41:01','',43,'http://ctc.cupertinotennisclub.org/index.php/2015/08/24/43-revision-v1/',0,'revision','',0),(45,132,'2015-08-24 20:41:39','2015-08-24 20:41:39','<div class=\"col-xs-12 col-md-12\">\r\n            <h1>CTC Activities</h1>\r\n              <p> If you\'re interested in tennis classes at Cupertino Sports Center, please check Lifetime Tennis website <a href=\"https://www.lifetimeactivities.com/cupertino/\">here</a>, or contact them directly at 408-777-3169. </p>\r\n              <p> The Cupertino Tennis Club in addition to USTA League teams, sponsor the the following activities: </p>\r\n              <ul class=\"front-page-list\">\r\n                <li> Women\'s Interclub. </li>\r\n                <li> Socials. </li>\r\n              </ul>  \r\n              \r\n              <p> <strong>  WOMEN\'S INTERCLUB </strong> <p>\r\n              <p> For those of you who have never played Women\'s Interclub, Interclub is a social/casual league where members from the Cupertino Tennis Club play with other clubs in the area. After playing, the group will enjoy lunch with the opponents. </p>  \r\n              <p> Interclub matches are played in the mornings, September through May with most of December off, and usually consist of four or five doubles matches. The playing level is usually between 3.0 and 4.0. There is no fee to play, and this is NOT a USTA sanctioned event.<p>\r\n              <p> The club now has three levels of women\'s interclub: 3.0, 3.5 and 4.0. &nbsp; If you are interested in playing, please contact the team captain(s) either directly or by clicking on their names for a current schedule of dates. </p>\r\n                <div class=\"table-responsive\">\r\n                  <table class=\"table table-hover table-bordered\">\r\n                      <thead>\r\n                          <tr class=\"success\">\r\n                               <th>Level</th>\r\n                               <th>Contact/Email</th>\r\n                          </tr>  \r\n                      </thead> \r\n                      <tbody>\r\n                           <tr>\r\n                               <th>3.5 level</th>\r\n                               <th><a href=\"mailto:womensinterclub35@cupertinotennisclub.org\"> Grace Haig </a></th>\r\n                          </tr>\r\n                           <tr>\r\n                               <th>4.0 level</th>\r\n                               <th><a href=\"mailto:womensinterclub40@cupertinotennisclub.org\"> Joan Hu </a></th>\r\n                          </tr>\r\n\r\n                      </tbody> \r\n                  </table>\r\n                </div>\r\n              <p> <strong> SOCIALS </strong> <p>\r\n              <p> Socials are scheduled throughout the year depending on court availability and interest. Your ideas and suggestions are always welcome, please contact Analiza Dolor at <a href=\"mailto:Socials@CupertinoTennisClub.org\">Socials</a>.</p>\r\n              <p> The Annual meeting is scheduled for early December each year. It is usually held off-site with pizza, drinks and dessert followed by--or prior to--the annual meeting and election of new board members. </p>\r\n              <p> More information prior to each event will be published in the Newsletter and on our Home Page. </p>\r\n              <p> Want to run, or help with, a social? Have questions? Contact the <a href=\"mailto:Socials@Cupertinotennisclub.org\">Socials Director</a>. </p>\r\n\r\n        </div>','Club Activities','','publish','closed','closed','','club-activities','','','2020-08-11 19:06:15','2020-08-12 02:06:15','',0,'http://ctc.cupertinotennisclub.org/?page_id=45',0,'page','',0),(46,1,'2015-08-24 20:41:39','2015-08-24 20:41:39','club activities here','Club Activities','','inherit','closed','closed','','45-revision-v1','','','2015-08-24 20:41:39','2015-08-24 20:41:39','',45,'http://ctc.cupertinotennisclub.org/index.php/2015/08/24/45-revision-v1/',0,'revision','',0),(47,31,'2015-08-24 20:42:11','2015-08-24 20:42:11','<div class=\"col-xs-12 col-md-8\">\r\n<h1>USTA League</h1>\r\n<ul class=\"front-page-list\">\r\n	<li>What is USTA League Tennis?</li>\r\n	<li>How do I join a CTC USTA League Team?</li>\r\n</ul>\r\n</div>\r\n<div class=\"col-xs-12 col-md-4\">\r\n<ul class=\"ustalist\">\r\n	<li><a href=\"http://ctc.cupertinotennisclub.org/declaretoplay/\"> DECLARE INTENT TO PLAY</a></li>\r\n	<li><a href=\"http://www.ustanorcal.com/organization.asp?id=113\" target=\"_blank\"> SEE ALL CTC TEAMS</a></li>\r\n	<li><a href=\"http://www.ustanorcal.com/ntrpsearch.asp?o=113#goto\" target=\"_blank\">CTC PLAYER\'S RATINGS</a></li>\r\n	<li><a href=\"http://www.usta.com/Adult-Tennis/USTA-League/ntrp/\" target=\"_blank\"> USTA RATINGS</a></li>\r\n	<li><a href=\"http://www.norcal.usta.com/adults/leagues/resources/\" target=\"_blank\">USTA GUIDE</a></li>\r\n</ul>\r\n</div>\r\n<div class=\"col-xs-12 col-md-12\">\r\n<h4 class=\"question\"><strong> What is USTA League Tennis?</strong></h4>\r\n<img class=\"pull-left ustaimg\" src=\"http://ctc.cupertinotennisclub.org/wp-content/uploads/2015/08/USTA_League-300x195.jpg\" alt=\"USTA League\" />\r\n\r\nThe USTA League Tennis is the country\'s largest recreational tennis league, providing organized, structured team matches for more than 300,000 men and women of all ability levels. In Northern California, tennis is an integral part of life in Northern California, and teams can be found on courts in the Bay Area and Sacramento, Santa Clara to Marin to Mendocino Counties, as far north as Redding and as far south as Fresno. Teams are set up according to NTRP rating, so you\'re always sure that you\'ll be facing off against someone of comparable ability. That keeps the competition lively and the atmosphere social. Read more at <a href=\"http://www.norcal.usta.com/\" target=\"_blank\"> USTA NorCal</a> website.\r\n<h4 class=\"question\"><strong> How do I join a CTC USTA League Tennis team?</strong></h4>\r\n<ul class=\"front-page-list\">\r\n	<li>Decide the level you wish to play (i.e. 2.5, 3.0 etc.). Your current USTA rating will help you decide. Determine your rating, if you do not have one, by using the USTA NorCal NTRP Self Rating Guidelines.</li>\r\n	<li>Check out the <a href=\"http://ctc.cupertinotennisclub.org/?p=33\">CTC Calendar </a> to learn about which teams are currently registering.</li>\r\n	<li>Contact the captain of the<a href=\"http://www.ustanorcal.com/organization.asp?id=113\" target=\"_blank\"> Cupertino team</a> you wish to play on and find out if the team needs players.</li>\r\n	<li>At the start of every season, teams have to be formed within a deadline. <a href=\"http://ctc.cupertinotennisclub.org/declaretoplay/\"> Declare your interest/intent to play </a> at the start of each league season.</li>\r\n	<li>Please note you have to be an annual Cupertino Sports Center member, an annual USTA member and Cupertino Tennis Club Member to play tennis on a Club-sponsored USTA team at the Sports Center.</li>\r\n	<li>If you still have a question please email <a href=\"mailto:womensusta@cupertinotennisclub.org\">womensusta@cupertinotennisclub.org</a> or <a href=\"mailto:mensusta@cupertinotennisclub.org\">mensusta@cupertinotennisclub.org</a>.</li>\r\n</ul>\r\nTo learn more about the club or get more involved by being a member, <a href=\"http://ctc.cupertinotennisclub.org/contact/\">contact us </a>.\r\n\r\n</div>','usta league','','publish','closed','closed','','usta-league','','','2015-12-08 15:00:29','2015-12-08 22:00:29','',0,'http://ctc.cupertinotennisclub.org/?page_id=47',0,'page','',0),(48,1,'2015-08-24 20:42:11','2015-08-24 20:42:11','usta league here','usta league','','inherit','closed','closed','','47-revision-v1','','','2015-08-24 20:42:11','2015-08-24 20:42:11','',47,'http://ctc.cupertinotennisclub.org/index.php/2015/08/24/47-revision-v1/',0,'revision','',0),(49,1,'2015-08-24 20:43:44','2015-08-24 20:43:44','News and Alerts here','news','','publish','closed','closed','','news','','','2015-08-24 20:43:44','2015-08-24 20:43:44','',0,'http://ctc.cupertinotennisclub.org/?page_id=49',0,'page','',0),(50,1,'2015-08-24 20:43:44','2015-08-24 20:43:44','News and Alerts here','news','','inherit','closed','closed','','49-revision-v1','','','2015-08-24 20:43:44','2015-08-24 20:43:44','',49,'http://ctc.cupertinotennisclub.org/index.php/2015/08/24/49-revision-v1/',0,'revision','',0),(52,1,'2015-08-24 20:48:19','2015-08-24 20:48:19','','USTA LEAGUE','','publish','closed','closed','','usta-league','','','2020-02-05 19:02:26','2020-02-06 03:02:26','',0,'http://ctc.cupertinotennisclub.org/?p=52',9,'nav_menu_item','',0),(53,1,'2015-08-24 20:48:19','2015-08-24 20:48:19','','CLUB ACTIVITIES','','publish','closed','closed','','club-activities','','','2020-02-05 19:02:26','2020-02-06 03:02:26','',0,'http://ctc.cupertinotennisclub.org/?p=53',8,