d this is NOT a USTA sanctioned event.<p>\r\n              <p> For those of you who have never played Interclub, Interclub is a social/casual league where members from the Cupertino Sports Center play with other clubs in the area. After playing, the group will enjoy lunch with the opponents. If you are interested in playing, please contact the team captain directly or click to <a href=\"mailto:womensinterclub@cupertinotennisclub.org\">send email</a>. </p>  \r\n              <p> The club now has three levels of women\'s interclub: 3.0, 3.5 and 4.0. Please contact one of the women\'s interclub coordinator\'s for a current schedule of dates. <p>\r\n                <div class=\"table-responsive\">\r\n                  <table class=\"table table-hover table-bordered\">\r\n                      <thead>\r\n                          <tr class=\"success\">\r\n                               <th>Level</th>\r\n                               <th>Contact/Email</th>\r\n                          </tr>  \r\n                      </thead> \r\n                      <tbody>\r\n                          <tr>\r\n                               <th>3.0 level</th>\r\n                               <th><a href=\"mailto:womensinterclub30@cupertinotennisclub.org\"> Pat Frischmann </a></th>\r\n                          </tr>\r\n                           <tr>\r\n                               <th>3.5 level</th>\r\n                               <th><a href=\"mailto:womensinterclub35@cupertinotennisclub.org\"> Emi Kawamoto </a></th>\r\n                          </tr>\r\n                           <tr>\r\n                               <th>4.0 level</th>\r\n                               <th><a href=\"mailto:womensinterclub40@cupertinotennisclub.org\"> Della Ong </a></th>\r\n                          </tr>\r\n\r\n                      </tbody> \r\n                  </table>\r\n                </div>\r\n              <p> <strong> SOCIALS </strong> <p>\r\n              <p> Socials are scheduled throughout the year depending on court availability and interest. Your ideas and suggestions are always welcome, please contact Lili Occena at <a href=\"mailto:Socials@CupertinoTennisClub.org\">Socials</a>.</p>\r\n              <p> The Annual meeting is scheduled for early December each year. It is usually held off-site with pizza, drinks and dessert followed by--or prior to--the annual meeting and election of new board members. </p>\r\n              <p> More information prior to each event will be published in the Newsletter and on our Home Page. </p>\r\n              <p> Want to run, or help with, a social? Have questions? Contact the <a href=\"mailto:Socials@Cupertinotennisclub.org\">Socials Director</a>. </p>\r\n\r\n        </div>','Club Activities','','inherit','closed','closed','','45-revision-v1','','','2015-08-25 00:28:55','2015-08-25 00:28:55','',45,'http://ctc.cupertinotennisclub.org/index.php/2015/08/25/45-revision-v1/',0,'revision','',0),(79,1,'2015-08-25 00:31:04','2015-08-25 00:31:04','<div class=\"col-xs-12 col-md-12\">\r\n            <h1>CTC Activities</h1>\r\n              <p> The Cupertino Tennis Club in addition to USTA League teams, sponsor the the following activities: </p>\r\n              <ul class=\"front-page-list\">\r\n                <li> Women\'s Interclub. </li>\r\n                <li> Men drop in every Mon/Wed/Fri at 12:00 pm. </li>\r\n                <li> Socials. </li>\r\n                <li> Drop in tennis is every Friday night at 6:45 pm conducted by the Cupertino Sports Center.</li>\r\n              </ul>  \r\n              \r\n              <p> <strong>  WOMEN\'S INTERCLUB </strong> <p>\r\n              <p> Women\'s Interclub is played in the mornings, September through May with most of December off, and consists of between four and five doubles matches with other clubs in the area. Playing level is usually between 3.0 and 4.0. There is no fee to play and this is NOT a USTA sanctioned event.<p>\r\n              <p> For those of you who have never played Interclub, Interclub is a social/casual league where members from the Cupertino Sports Center play with other clubs in the area. After playing, the group will enjoy lunch with the opponents. If you are interested in playing, please contact the team captain directly or click to <a href=\"mailto:womensinterclub@cupertinotennisclub.org\">send email</a>. </p>  \r\n              <p> The club now has three levels of women\'s interclub: 3.0, 3.5 and 4.0. Please contact one of the women\'s interclub coordinator\'s for a current schedule of dates. <p>\r\n                <div class=\"table-responsive\">\r\n                  <table class=\"table table-hover table-bordered\">\r\n                      <thead>\r\n                          <tr class=\"success\">\r\n                               <th>Level</th>\r\n                               <th>Contact/Email</th>\r\n                          </tr>  \r\n                      </thead> \r\n                      <tbody>\r\n                          <tr>\r\n                               <th>3.0 level</th>\r\n                               <th><a href=\"mailto:womensinterclub30@cupertinotennisclub.org\"> Pat Frischmann </a></th>\r\n                          </tr>\r\n                           <tr>\r\n                               <th>3.5 level</th>\r\n                               <th><a href=\"mailto:womensinterclub35@cupertinotennisclub.org\"> Emi Kawamoto </a></th>\r\n                          </tr>\r\n                           <tr>\r\n                               <th>4.0 level</th>\r\n                               <th><a href=\"mailto:womensinterclub40@cupertinotennisclub.org\"> Della Ong </a></th>\r\n                          </tr>\r\n\r\n                      </tbody> \r\n                  </table>\r\n                </div>\r\n              <p> <strong> SOCIALS </strong> <p>\r\n              <p> Socials are scheduled throughout the year depending on court availability and interest. Your ideas and suggestions are always welcome, please contact Lili Occena at <a href=\"mailto:Socials@CupertinoTennisClub.org\">Socials</a>.</p>\r\n              <p> The Annual meeting is scheduled for early December each year. It is usually held off-site with pizza, drinks and dessert followed by--or prior to--the annual meeting and election of new board members. </p>\r\n              <p> More information prior to each event will be published in the Newsletter and on our Home Page. </p>\r\n              <p> Want to run, or help with, a social? Have questions? Contact the <a href=\"mailto:Socials@Cupertinotennisclub.org\">Socials Director</a>. </p>\r\n\r\n        </div>','Club Activities','','inherit','closed','closed','','45-revision-v1','','','2015-08-25 00:31:04','2015-08-25 00:31:04','',45,'http://ctc.cupertinotennisclub.org/index.php/2015/08/25/45-revision-v1/',0,'revision','',0),(80,1,'2015-08-25 00:43:39','2015-08-25 00:43:39','<div class=\"col-xs-12 col-md-9 maintext\">\r\n           <ul>\r\n            <li> What is USTA League Tennis?</li>\r\n            <li>How do I play USTA League Tennis for a Cupertino USTA team? </li>\r\n            <li> CTC versus CSC. What\'s the difference?</li>\r\n           </ul> \r\n         <p class=\"text-success\"> <strong> What is USTA League Tennis?</strong></p>\r\n         <p>The USTA League Tennis is the country\'s largest recreational tennis league, providing organized, structured team matches for more than 300,000 men and women of all ability levels. In Northern California, tennis is an integral part of life in Northern California, and teams can be found on courts in the Bay Area and Sacramento, Santa Clara to Marin to Mendocino Counties, as far north as Redding and as far south as Fresno. Teams are set up according to NTRP rating, so you\'re always sure that you\'ll be facing off against someone of comparable ability. That keeps the competition lively and the atmosphere social. Read more at <a href=\"http://www.norcal.usta.com/\" target=\"_blank\"> USTA NorCal</a> website.</p>\r\n         <p class=\"text-success\"> <strong> How do I play USTA League Tennis for a Cupertino USTA team?</strong></p>\r\n         <ul>\r\n             <li> Decide the level you wish to play (i.e. 2.5, 3.0 etc.). Your current USTA rating will help you decide. Determine your rating, if you do not have one, by using the USTA NorCal NTRP Self Rating Guidelines.</li>\r\n             <li> Check out the <a href=\"calendar.php\">CTC Calendar </a> to learn about which teams are currently registering. </li>\r\n             <li> Contact the captain of the<a href=\"http://www.ustanorcal.com/organization.asp?id=113\" target=\"_blank\"> Cupertino team</a> you wish to play on and find out if the team needs players. </li>\r\n             <li> At the start of every season, teams have to be formed within a deadline. <a href=\"declare-play.php\"> Declare your interest/intent to play </a> at the start of each league season. </li>\r\n             <li> If it is too late to form and/or join a team for the current season, be sure to plan in advance for the next season!! You can also request the captains to allow you to practice with their teams. This is a great way to meet new people and plan for the next season.</li>\r\n             <li> Please note you have to be an annual Cupertino Sports Center member, an annual USTA member and Cupertino Tennic Club Member to play tennis on a Club-sponsored USTA team at the Sports Center. </li>\r\n             <li> If you still have a question please email <a href=\"mailto:womensusta@cupertinotennisclub.org\">womensusta@cupertinotennisclub.org</a> or <a href=\"mailto:mensusta@cupertinotennisclub.org\">mensusta@cupertinotennisclub.org</a>.</li>\r\n         </ul> \r\n          <p class=\"text-success\"> <strong> CTC versus CSC. What\'s the difference?</strong></p>\r\n          <p> There is occasional confusion about the two entities - the Cupertino Sports Center (CSC) and the Cupertino Tennis Club (CTC). Why are there two and why you should join both if you play tennis.</p>\r\n          <p>Like other cities, Cupertino provides recreational facilities for its residents. The Sports Center is one such facility and although tennis courts are a big part, it is not just about tennis. There is also the Teen Center, handball, racquetball, table tennis, workout equipment, classes, etc. The CSC is the facility and the city allows the Club to use the facility for USTA matches and other Club activities that promote tennis in the community. </p>\r\n          <p> The Cupertino Tennis Club organizes club activities, interclubs and teams that participate in USTA Leagues. The club is run by a board of directors and has a constitution and bylaws.</p>\r\n          <p> In summary, if you want to play tennis at the CSC you must be a Sports Center passholder. If you want to participate in CTC activities you must be a member of the Tennis Club. And if you want to play tennis on a Club-sponsored USTA team at the Sports Center you must belong to the CTC and also be an annual passholder of the CSC. The annual CSC membership is a requirement from the city of Cupertino.</p>\r\n          <p> To learn more about the club or get more involved by being a member, <a href=\"contact.php\">contact </a> any member of the board. </p>\r\n        </div>\r\n','usta league','','inherit','closed','closed','','47-revision-v1','','','2015-08-25 00:43:39','2015-08-25 00:43:39','',47,'http://ctc.cupertinotennisclub.org/index.php/2015/08/25/47-revision-v1/',0,'revision','',0),(81,1,'2015-08-25 00:44:24','2015-08-25 00:44:24','<div class=\"col-xs-12 col-md-9\">\r\n           <ul>\r\n            <li> What is USTA League Tennis?</li>\r\n            <li>How do I play USTA League Tennis for a Cupertino USTA team? </li>\r\n            <li> CTC versus CSC. What\'s the difference?</li>\r\n           </ul> \r\n         <p class=\"text-success\"> <strong> What is USTA League Tennis?</strong></p>\r\n         <p>The USTA League Te