-25 00:51:12','<div class=\"col-xs-12 col-md-9\">\r\n    <h1> USTA League </h1>\r\n           <ul class=\"front-page-list\">\r\n            <li> What is USTA League Tennis?</li>\r\n            <li>How do I join a CTC USTA League Tennis team? </li>\r\n           </ul> \r\n         <p class=\"text-success\"> <strong> What is USTA League Tennis?</strong></p>\r\n         <p>The USTA League Tennis is the country\'s largest recreational tennis league, providing organized, structured team matches for more than 300,000 men and women of all ability levels. In Northern California, tennis is an integral part of life in Northern California, and teams can be found on courts in the Bay Area and Sacramento, Santa Clara to Marin to Mendocino Counties, as far north as Redding and as far south as Fresno. Teams are set up according to NTRP rating, so you\'re always sure that you\'ll be facing off against someone of comparable ability. That keeps the competition lively and the atmosphere social. Read more at <a href=\"http://www.norcal.usta.com/\" target=\"_blank\"> USTA NorCal</a> website.</p>\r\n         <p class=\"text-success\"> <strong> How do I join a CTC USTA League Tennis team?</strong></p>\r\n         <ul>\r\n             <li> Decide the level you wish to play (i.e. 2.5, 3.0 etc.). Your current USTA rating will help you decide. Determine your rating, if you do not have one, by using the USTA NorCal NTRP Self Rating Guidelines.</li>\r\n             <li> Check out the <a href=\"http://ctc.cupertinotennisclub.org/?p=33\">CTC Calendar </a> to learn about which teams are currently registering. </li>\r\n             <li> Contact the captain of the<a href=\"http://www.ustanorcal.com/organization.asp?id=113\" target=\"_blank\"> Cupertino team</a> you wish to play on and find out if the team needs players. </li>\r\n             <li> At the start of every season, teams have to be formed within a deadline. <a href=\"declare-play.php\"> Declare your interest/intent to play </a> at the start of each league season. </li>\r\n             <li> Please note you have to be an annual Cupertino Sports Center member, an annual USTA member and Cupertino Tennis Club Member to play tennis on a Club-sponsored USTA team at the Sports Center. </li>\r\n             <li> If you still have a question please email <a href=\"mailto:womensusta@cupertinotennisclub.org\">womensusta@cupertinotennisclub.org</a> or <a href=\"mailto:mensusta@cupertinotennisclub.org\">mensusta@cupertinotennisclub.org</a>.</li>\r\n         </ul> \r\n          <p class=\"text-success\"> <strong> CTC versus CSC. What\'s the difference?</strong></p>\r\n          <p> There is occasional confusion about the two entities - the Cupertino Sports Center (CSC) and the Cupertino Tennis Club (CTC). Why are there two and why you should join both if you play tennis.</p>\r\n          <p>Like other cities, Cupertino provides recreational facilities for its residents. The Sports Center is one such facility and although tennis courts are a big part, it is not just about tennis. There is also the Teen Center, handball, racquetball, table tennis, workout equipment, classes, etc. The CSC is the facility and the city allows the Club to use the facility for USTA matches and other Club activities that promote tennis in the community. </p>\r\n          <p> The Cupertino Tennis Club organizes club activities, interclubs and teams that participate in USTA Leagues. The club is run by a board of directors and has a constitution and bylaws.</p>\r\n          <p> In summary, if you want to play tennis at the CSC you must be a Sports Center passholder. If you want to participate in CTC activities you must be a member of the Tennis Club. And if you want to play tennis on a Club-sponsored USTA team at the Sports Center you must belong to the CTC and also be an annual passholder of the CSC. The annual CSC membership is a requirement from the city of Cupertino.</p>\r\n          <p> To learn more about the club or get more involved by being a member, <a href=\"contact.php\">contact </a> any member of the board. </p>\r\n        </div>','usta league','','inherit','closed','closed','','47-revision-v1','','','2015-08-25 00:51:12','2015-08-25 00:51:12','',47,'http://ctc.cupertinotennisclub.org/index.php/2015/08/25/47-revision-v1/',0,'revision','',0),(87,1,'2015-08-25 00:53:11','2015-08-25 00:53:11','<div class=\"col-xs-12 col-md-12\">\r\n\r\n					<h1>Frequently Asked Questions about the new League Interest Sign-up Process! </h1>\r\n					 \r\n                    <ul>\r\n<li> <h4 class=\"question\"> <strong> CTC versus CSC. What is the difference? </strong></h4>\r\n <p> There is occasional confusion about the two entities - the Cupertino Sports Center (CSC) and the Cupertino Tennis Club (CTC). Why are there two and why you should join both if you play tennis.</p>\r\n          <p>Like other cities, Cupertino provides recreational facilities for its residents. The Sports Center is one such facility and although tennis courts are a big part, it is not just about tennis. There is also the Teen Center, handball, racquetball, table tennis, workout equipment, classes, etc. The CSC is the facility and the city allows the Club to use the facility for USTA matches and other Club activities that promote tennis in the community. </p>\r\n          <p> The Cupertino Tennis Club organizes club activities, interclubs and teams that participate in USTA Leagues. The club is run by a board of directors and has a constitution and bylaws.</p>\r\n          <p> In summary, if you want to play tennis at the CSC you must be a Sports Center passholder. If you want to participate in CTC activities you must be a member of the Tennis Club. And if you want to play tennis on a Club-sponsored USTA team at the Sports Center you must belong to the CTC and also be an annual passholder of the CSC. The annual CSC membership is a requirement from the city of Cupertino.</p>                   		\r\n</li>\r\n<li> <h4 class=\"question\"><strong> Why do we suddenly have to do this? </strong></h4>\r\n                    		<p> The recent growth in club membership and number of league teams is approaching the limit of court availability during some league seasons. This \"suddenly\" came to our attention when 22 captains registered teams for the 2009 Adult season. The lighting upgrade is also reducing the number of courts at this time.</p>\r\n</li>\r\n<li> <h4 class=\"question\"><strong> Some of the links on the page said that the sign-up period was not open yet. How will we know when to do it?  </strong></h4>\r\n                    		<p> Each league will have its own form and period in which to use it. Each sign-up period will be announced by email and on the website.</p>\r\n</li>\r\n<li> <h4 class=\"question\"> <strong> I wanted to do the whole year and get it out of the way. Why can\'t I do that?  </strong></h4>\r\n                    		<p> To do the best job of scheduling, we need the most up-to-date information possible. Lots of things can happen during a year: Vacation plans can change, jobs can change, injuries happen (suddenly), ratings get changed, personal interests can change, etc. </p>\r\n</li>\r\n<li> <h4 class=\"question\"><strong> What if I am on an extended business trip during the sign-up period? Can there be an exception is such cases?   </strong></h4>\r\n                    		<p>Of course! The process is not meant to exclude anyone, but your question highlights the reason why everyone needs to use the form: A small number of people can be added to teams if necessary, but if a lot of people ignore the process, it could lead to there not being enough teams registered for everyone to play on a team of reasonable size. </p>\r\n</li>\r\n<li> <h4 class=\"question\"> <strong> Does this mean you are going to assign players arbitrarily to teams?  </strong></h4>\r\n                    		<p> Oh, no. That would only happen in the small number of cases where a new member wanted to play but didn\'t know anyone. \r\nThe intent is to determine how many teams we need to support the level of interest expressed by the members. Some captains know they already have full rosters before the season starts, and others are looking to fill open spots. Hopefully, we can get the uncommitted players in touch with the captains who need people. Or we can form new teams of players who are not committed to a particular team. </p>\r\n</li>\r\n<li><h4 class=\"question\"> <strong> Does this mean that you plan to limit the number of teams a member can play on, even if several captains want that member and the member wants to play? </strong></h4>\r\n                    		<p> Not necessarily. We really have no way to keep players from registering on teams once the team has been registered, but we do feel obligated to help find spots for all of our members to play somewhere. </p>\r\n</li>\r\n<li><h4 class=\"question\"> <strong> Does this mean that you may have a cut off for the number of teams, even if you have captains who want to captain and players who want to play for them?  </strong></h4>\r\n                    		<p> That is a possibility. The city effectively limits the number of teams we can field for USTA by some of their policies. The growth in membership puts us in jeopardy of exceeding those limits. These procedures are intended to maximize the number of members who get an opportunity to play USTA while not exceeding the court usage capacity. </p>\r\n</li>\r\n<li><h4 class=\"question\"> <strong>I\'m confused by \"level\" on the form. I\'m a 4.0, but the only \"levels\" available are 6.0 and higher.   </strong></h4>\r\n                    		<p> The \"level\" on the form refers to the League combined level of play for each doubles partnership. For example, players in the 7.0 league can combine as two 3.5 players, or a 3.0 player and a 4.0 player. (All of the Norcal leagues are \"combined\" leagues except Adult, Senior, and Super Senior 65.)  </p>\r\n</li>	 \r\n</ul>\r\n<p class=\"text-success\"> To ask a question or voice a concern, please email the club <a href=\"mailto:USTA@cupertinotennisclub.org\">USTA Coordinator</a>.</p>\r\n</div>	','faq','','publish','closed','closed','','faq','','','2015-08-25 23:27:50','2015-08-25 23:27:50','',0,'http://ctc.cupertinotennisclub.org/?page_id=87',0,'page','',0),(88,1,'2015-08-25 00:53:11','2015-08-25 00:53:11','faq here','faq','','inherit','closed','closed','','87-revision-v1','','','2015-08-25 00:53:11','2015-08-25 00:53:11','',87,'http://ctc.cupertinotennisclub.org/index.php/2015/08/25/87-revision-v1/',0,'revision','',0),(89,1,'2015-08-25 23:26:58','2015-08-25 23:26:58','<div class=\"col-xs-12 col-md-12\">\n\n					<h1>Frequently Asked Questions about the new League Interest Sign-up Process! </h1>\n					 \n                    <ul>\n<li> <h4 class=\"question\"> <strong> CTC versus CSC. What is the difference? </strong></h4>\n <p> There is occasional confusion about the two entities - the Cupertino Sports Center (CSC) and the Cupertino Tennis Club (CTC). Why are there two and why you should join both if you play tennis.</p>\n          <p>Like other cities, Cupertino provides recreational facilities for its residents. The Sports Center is one such facility and although tennis courts are a big part, it is not just about tennis. There is also the Teen Center, handball, racquetball, table tennis, workout equipment, classes, etc. The CSC is the facility and the city allows the Club to use the facility for USTA matches and other Club activities that promote tennis in the community. </p>\n          <p> The Cupertino Tennis Club organizes club activities, interclubs and teams that participate in USTA Leagues. The club is run by a board of directors and has a constitution and bylaws.</p>\n          <p> In summary, if you want to play tennis at the CSC you must be a Sports Center passholder. If you want to participate in CTC activities you must be a member of the Tennis Club. And if you want to play tennis on a Club-sponsored USTA team at the Sports Center you must belong to the CTC and also be an annual passholder of the CSC. The annual CSC membership is a requirement from the city of Cupertino.</p>                   		\n</li>\n<li> <h4 class=\"question\"><strong> Why do we suddenly have to do this? </strong></h4>\n                    		<p> The recent growth in club membership and number of league teams is approaching the limit of court availability during some league seasons. This \"suddenly\" came to our attention when 22 captains registered teams for the 2009 Adult season. The lighting upgrade is also reducing the number of courts at this time.</p>\n</li>\n<li> <h4 class=\"question\"><strong> Some of the links on the page said that the sign-up period was not open yet. How will we know when to do it?  </strong></h4>\n                    		<p> Each league will have its own form and period in which to use it. Each sign-up period will be announced by email and on the website.</p>\n</li>\n<li> <h4 class=\"question\"> <strong> I wanted to do the whole year and get it out of the way. Why can\'t I do that?  </strong></h4>\n                    		<p> To do the best job of scheduling, we need the most up-to-date information possible. Lots of things can happen during a year: Vacation plans can change, jobs can change, injuries happen (suddenly), ratings get changed, personal interests can change, etc. </p>\n</li>\n<li> <h4 class=\"question\"><strong> What if I am on an extended business trip during the sign-up period? Can there be an exception is such cases?   </strong></h4>\n                    		<p>Of course! The process is not meant to exclude anyone, but your question highlights the reason why everyone needs to use the form: A small number of people can be added to teams if necessary, but if a lot of people ignore the process, it could lead to there not being enough teams registered for everyone to play on a team of reasonable size. </p>\n</li>\n<li> <h4 class=\"question\"> <strong> Does this mean you are going to assign players arbitrarily to teams?  </strong></h4>\n                    		<p> Oh, no. That would only happen in the small number of cases where a new member wanted to play but didn\'t know anyone. \nThe intent is to determine how many teams we need to support the level of interest expressed by the members. Some captains know they already have full rosters before the season starts, and others are looking to fill open spots. Hopefully, we can get the uncommitted players in touch with the captains who need people. Or we can form new teams of players who are not committed to a particular team. </p>\n</li>\n<li><h4 class=\"question\"> <strong> Does this mean that you plan to limit the number of teams a member can play on, even if several captains want that member and the member wants to play? </strong></h4>\n                    		<p> Not necessarily. We really have no way to keep players from registering on teams once the team has been registered, but we do feel obligated to help find spots for all of our members to play somewhere. </p>\n</li>\n<li><h4 class=\"que <strong> Does this mean that you may have a cut off for the number of teams, even if you have captains who want to captain and players who want to play for them?  </strong>\n                    		<p> That is a possibility. The city effectively limits the number of teams we can field for USTA by some of their policies. The growth in membership puts us in jeopardy of exceeding those limits. These procedures are intended to maximize the number of members who get an opportunity to play USTA while not exceeding the court usage capacity. </p>\n                    	</li>\n                    	<li> <strong>I\'m confused by \"level\" on the form. I\'m a 4.0, but the only \"levels\" available are 6.0 and higher.   </strong>\n                    		<p> The \"level\" on the form refers to the League combined level of play for each doubles partnership. For example, players in the 7.0 league can combine as two 3.5 players, or a 3.0 player and a 4.0 player. (All of the Norcal leagues are \"combined\" leagues except Adult, Senior, and Super Senior 65.)  </p>\n                    	</li>	 \n</ul>\n<p class=\"text-success\"> To ask a question or voice a concern, please email the club <a href=\"mailto:USTA@cupertinotennisclub.org\">USTA Coordinator</a>.</p>\n</div>	','faq','','inherit','closed','closed','','87-autosave-v1','','','2015-08-25 23:26:58','2015-08-25 23:26:58','',87,'http://ctc.cupertinotennisclub.org/index.php/2015/08/25/87-autosave-v1/',0,'revision','',0),(90,1,'2015-08-25 00:57:43','2015-08-25 00:57:43','<div class=\"col-xs-12 col-md-9\">\r\n\r\n					<h1>Frequently Asked Questions about the new League Interest Sign-up Process! </h1>\r\n					 \r\n                    <ul>\r\n<li> <strong> CTC versus CSC. What is the difference? </strong>\r\n <p> There is occasional confusion about the two entities - the Cupertino Sports Center (CSC) and the Cupertino Tennis Club (CTC). Why are there two and why you should join both if you play tennis.</p>\r\n          <p>Like other cities, Cupertino provides recreational facilities for its residents. The Sports Center is one such facility and although tennis courts are a big part, it is not just about tennis. There is also the Teen Center, handball, racquetball, table tennis, workout equipment, classes, etc. The CSC is the facility and the city allows the Club to use the facility for USTA matches and other Club activities that promote tennis in the community. </p>\r\n          <p> The Cupertino Tennis Club organizes club activities, interclubs and teams that participate in USTA Leagues. The club is run by a board of directors and has a constitution and bylaws.</p>\r\n          <p> In summary, if you want to play tennis at the CSC you must be a Sports Center passholder. If you want to participate in CTC activities you must be a member of the Tennis Club. And if you want to play tennis on a Club-sponsored USTA team at the Sports Center you must belong to the CTC and also be an annual passholder of the CSC. The annual CSC membership is a requirement from the city of Cupertino.</p>                   		\r\n                    	</li>\r\n                    	<li> <strong> Why do we suddenly have to do this? </strong>\r\n                    		<p> The recent growth in club membership and number of league teams is approaching the limit of court availability during some league seasons. This \"suddenly\" came to our attention when 22 captains registered teams for the 2009 Adult season. The lighting upgrade is also reducing the number of courts at this time.</p>\r\n                    	</li>\r\n                    	<li> <strong> Some of the links on the page said that the sign-up period was not open yet. How will we know when to do it?  </strong>\r\n                    		<p> Each league will have its own form and period in which to use it. Each sign-up period will be announced by email and on the website.</p>\r\n                    	</li>\r\n                    	<li> <strong> I wanted to do the whole year and get it out of the way. Why can\'t I do that?  </strong>\r\n                    		<p> To do the best job of scheduling, we need the most up-to-date information possible. Lots of things can happen during a year: Vacation plans can change, jobs can change, injuries happen (suddenly), ratings get changed, personal interests can change, etc. </p>\r\n                    	</li>\r\n                    	<li> <strong> What if I am on an extended business trip during the sign-up period? Can there be an exception is such cases?   </strong>\r\n                    		<p>Of course! The process is not meant to exclude anyone, but your question highlights the reason why everyone needs to use the form: A small number of people can be added to teams if necessary, but if a lot of people ignore the process, it could lead to there not being enough teams registered for everyone to play on a team of reasonable size. </p>\r\n                    	</li>\r\n                    	<li> <strong> Does this mean you are going to assign players arbitrarily to teams?  </strong>\r\n                    		<p> Oh, no. That would only happen in the small number of cases where a new member wanted to play but didn\'t know anyone. \r\nThe intent is to determine how many teams we need to support the level of interest expressed by the members. Some captains know they already have full rosters before the season starts, and others are looking to fill open spots. Hopefully, we can get the uncommitted players in touch with the captains who need people. Or we can form new teams of players who are not committed to a particular team. </p>\r\n                    	</li>\r\n                    	<li> <strong> Does this mean that you plan to limit the number of teams a member can play on, even if several captains want that member and the member wants to play? </strong>\r\n                    		<p> Not necessarily. We really have no way to keep players from registering on teams once the team has been registered, but we do feel obligated to help find spots for all of our members to play somewhere. </p>\r\n                    	</li>\r\n                    	<li> <strong> Does this mean that you may have a cut off for the number of teams, even if you have captains who want to captain and players who want to play for them?  </strong>\r\n                    		<p> That is a possibility. The city effectively limits the number of teams we can field for USTA by some of their policies. The growth in membership puts us in jeopardy of exceeding those limits. These procedures are intended to maximize the number of members who get an opportunity to play USTA while not exceeding the court usage capacity. </p>\r\n                    	</li>\r\n                    	<li> <strong>I\'m confused by \"level\" on the form. I\'m a 4.0, but the only \"levels\" available are 6.0 and higher.   </strong>\r\n                    		<p> The \"level\" on the form refers to the League combined level of play for each doubles partnership. For example, players in the 7.0 league can combine as two 3.5 players, or a 3.0 player and a 4.0 player. (All of the Norcal leagues are \"combined\" leagues except Adult, Senior, and Super Senior 65.)  </p>\r\n                    	</li>	 \r\n                    </ul>\r\n                        <p class=\"text-success\"> To ask a question or voice a concern, please email the club <a href=\"mailto:USTA@cupertinotennisclub.org\">USTA \r\n      Coordinator</a>.</p>\r\n</div>	','faq','','inherit','closed','closed','','87-revision-v1','','','2015-08-25 00:57:43','2015-08-25 00:57:43','',87,'http://ctc.cupertinotennisclub.org/index.php/2015/08/25/87-revision-v1/',0,'revision','',0),(91,1,'2015-08-25 01:01:12','2015-08-25 01:01:12','<div class=\"col-xs-12 col-md-12\">\r\n\r\n					<h1>Frequently Asked Questions about the new League Interest Sign-up Process! </h1>\r\n					 \r\n                    <ul>\r\n<li> <strong> CTC versus CSC. What is the difference? </strong>\r\n <p> There is occasional confusion about the two entities - the Cupertino Sports Center (CSC) and the Cupertino Tennis Club (CTC). Why are there two and why you should join both if you play tennis.</p>\r\n          <p>Like other cities, Cupertino provides recreational facilities for its residents. The Sports Center is one such facility and although tennis courts are a big part, it is not just about tennis. There is also the Teen Center, handball, racquetball, table tennis, workout equipment, classes, etc. The CSC is the facility and the city allows the Club to use the facility for USTA matches and other Club activities that promote tennis in the community. </p>\r\n          <p> The Cupertino Tennis Club organizes club activities, interclubs and teams that participate in USTA Leagues. The club is run by a board of directors and has a constitution and bylaws.</p>\r\n          <p> In summary, if you want to play tennis at the CSC you must be a Sports Center passholder. If you want to participate in CTC activities you must be a member of the Tennis Club. And if you want to play tennis on a Club-sponsored USTA team at the Sports Center you must belong to the CTC and also be an annual passholder of the CSC. The annual CSC membership is a requirement from the city of Cupertino.</p>                   		\r\n</li>\r\n<li> <strong> Why do we suddenly have to do this? </strong>\r\n     <p> The recent growth in club membership and number of league teams is approaching the limit of court availability during some league seasons. This \"suddenly\" came to our attention when 22 captains registered teams for the 2009 Adult season. The lighting upgrade is also reducing the number of courts at this time.</p>\r\n</li>\r\n<li> <strong> Some of the links on the page said that the sign-up period was not open yet. How will we know when to do it?  </strong>\r\n     <p> Each league will have its own form and period in which to use it. Each sign-up period will be announced by email and on the website.</p>\r\n</li>\r\n<li> <strong> I wanted to do the whole year and get it out of the way. Why can\'t I do that?  </strong>\r\n     <p> To do the best job of scheduling, we need the most up-to-date information possible. Lots of things can happen during a year: Vacation plans can change, jobs can change, injuries happen (suddenly), ratings get changed, personal interests can change, etc. </p>\r\n</li>\r\n<li> <strong> What if I am on an extended business trip during the sign-up period? Can there be an exception is such cases?   </strong>\r\n     <p>Of course! The process is not meant to exclude anyone, but your question highlights the reason why everyone needs to use the form: A small number of people can be added to teams if necessary, but if a lot of people ignore the process, it could lead to there not being enough teams registered for everyone to play on a team of reasonable size. </p>\r\n</li>\r\n<li> <strong> Does this mean you are going to assign players arbitrarily to teams?  </strong>\r\n     <p> Oh, no. That would only happen in the small number of cases where a new member wanted to play but didn\'t know anyone. \r\nThe intent is to determine how many teams we need to support the level of interest expressed by the members. Some captains know they already have full rosters before the season starts, and others are looking to fill open spots. Hopefully, we can get the uncommitted players in touch with the captains who need people. Or we can form new teams of players who are not committed to a particular team. </p>\r\n</li>\r\n                    	<li> <strong> Does this mean that you plan to limit the number of teams a member can play on, even if several captains want that member and the member wants to play? </strong>\r\n                    		<p> Not necessarily. We really have no way to keep players from registering on teams once the team has been registered, but we do feel obligated to help find spots for all of our members to play somewhere. </p>\r\n                    	</li>\r\n                    	<li> <strong> Does this mean that you may have a cut off for the number of teams, even if you have captains who want to captain and players who want to play for them?  </strong>\r\n                    		<p> That is a possibility. The city effectively limits the number of teams we can field for USTA by some of their policies. The growth in membership puts us in jeopardy of exceeding those limits. These procedures are intended to maximize the number of members who get an opportunity to play USTA while not exceeding the court usage capacity. </p>\r\n                    	</li>\r\n                    	<li> <strong>I\'m confused by \"level\" on the form. I\'m a 4.0, but the only \"levels\" available are 6.0 and higher.   </strong>\r\n                    		<p> The \"level\" on the form refers to the League combined level of play for each doubles partnership. For example, players in the 7.0 league can combine as two 3.5 players, or a 3.0 player and a 4.0 player. (All of the Norcal leagues are \"combined\" leagues except Adult, Senior, and Super Senior 65.)  </p>\r\n                    	</li>	 \r\n                    </ul>\r\n                        <p class=\"text-success\"> To ask a question or voice a concern, please email the club <a href=\"mailto:USTA@cupertinotennisclub.org\">USTA \r\n      Coordinator</a>.</p>\r\n</div>	','faq','','inherit','closed','closed','','87-revision-v1','','','2015-08-25 01:01:12','2015-08-25 01:01:12','',87,'http://ctc.cupertinotennisclub.org/index.php/2015/08/25/87-revision-v1/',0,'revision','',0),(92,1,'2015-08-25 01:01:27','2015-08-25 01:01:27','<div class=\"col-xs-12 col-md-12\">\r\n\r\n<h1>Frequently Asked Questions about the new League Interest Sign-up Process! </h1>\r\n					 \r\n<ul>\r\n<li> <strong> CTC versus CSC. What is the difference? </strong>\r\n <p> There is occasional confusion about the two entities - the Cupertino Sports Center (CSC) and the Cupertino Tennis Club (CTC). Why are there two and why you should join both if you play tennis.</p>\r\n          <p>Like other cities, Cupertino provides recreational facilities for its residents. The Sports Center is one such facility and although tennis courts are a big part, it is not just about tennis. There is also the Teen Center, handball, racquetball, table tennis, workout equipment, classes, etc. The CSC is the facility and the city allows the Club to use the facility for USTA matches and other Club activities that promote tennis in the community. </p>\r\n          <p> The Cupertino Tennis Club organizes club activities, interclubs and teams that participate in USTA Leagues. The club is run by a board of directors and has a constitution and bylaws.</p>\r\n          <p> In summary, if you want to play tennis at the CSC you must be a Sports Center passholder. If you want to participate in CTC activities you must be a member of th