combined\" leagues except Adult, Senior, and Super Senior 65.)  </p>\r\n                    	</li>	 \r\n                    </ul>\r\n                        <p class=\"text-success\"> To ask a question or voice a concern, please email the club <a href=\"mailto:USTA@cupertinotennisclub.org\">USTA \r\n      Coordinator</a>.</p>\r\n</div>	','faq','','inherit','closed','closed','','87-revision-v1','','','2015-08-25 01:01:27','2015-08-25 01:01:27','',87,'http://ctc.cupertinotennisclub.org/index.php/2015/08/25/87-revision-v1/',0,'revision','',0),(93,1,'2015-08-25 01:02:50','2015-08-25 01:02:50','<div class=\"col-xs-12 col-md-9\">\r\n\r\n					<h1>Frequently Asked Questions about the new League Interest Sign-up Process! </h1>\r\n					 \r\n                    <ul>\r\n<li> <strong> CTC versus CSC. What is the difference? </strong>\r\n <p> There is occasional confusion about the two entities - the Cupertino Sports Center (CSC) and the Cupertino Tennis Club (CTC). Why are there two and why you should join both if you play tennis.</p>\r\n          <p>Like other cities, Cupertino provides recreational facilities for its residents. The Sports Center is one such facility and although tennis courts are a big part, it is not just about tennis. There is also the Teen Center, handball, racquetball, table tennis, workout equipment, classes, etc. The CSC is the facility and the city allows the Club to use the facility for USTA matches and other Club activities that promote tennis in the community. </p>\r\n          <p> The Cupertino Tennis Club organizes club activities, interclubs and teams that participate in USTA Leagues. The club is run by a board of directors and has a constitution and bylaws.</p>\r\n          <p> In summary, if you want to play tennis at the CSC you must be a Sports Center passholder. If you want to participate in CTC activities you must be a member of the Tennis Club. And if you want to play tennis on a Club-sponsored USTA team at the Sports Center you must belong