o the League combined level of play for each doubles partnership. For example, players in the 7.0 league can combine as two 3.5 players, or a 3.0 player and a 4.0 player. (All of the Norcal leagues are \"combined\" leagues except Adult, Senior, and Super Senior 65.)  </p>\r\n                    	</li>	 \r\n</ul>\r\n<p class=\"text-success\"> To ask a question or voice a concern, please email the club <a href=\"mailto:USTA@cupertinotennisclub.org\">USTA Coordinator</a>.</p>\r\n</div>	','faq','','inherit','closed','closed','','87-revision-v1','','','2015-08-25 01:02:50','2015-08-25 01:02:50','',87,'http://ctc.cupertinotennisclub.org/index.php/2015/08/25/87-revision-v1/',0,'revision','',0),(94,1,'2015-08-25 01:03:08','2015-08-25 01:03:08','<div class=\"col-xs-12 col-md-9\">\r\n    <h1> USTA League </h1>\r\n           <ul class=\"front-page-list\">\r\n            <li> What is USTA League Tennis?</li>\r\n            <li>How do I join a CTC USTA League Tennis team? </li>\r\n           </ul> \r\n         <p class=\"text-success\"> <strong> What is USTA League Tennis?</strong></p>\r\n         <p>The USTA League Tennis is the country\'s largest recreational tennis league, providing organized, structured team matches for more than 300,000 men and women of all ability levels. In Northern California, tennis is an integral part of life in Northern California, and teams can be found on courts in the Bay Area and Sacramento, Santa Clara to Marin to Mendocino Counties, as far north as Redding and as far south as Fresno. Teams are set up according to NTRP rating, so you\'re always sure that you\'ll be facing off against someone of comparable ability. That keeps the competition lively and the atmosphere social. Read more at <a href=\"http://www.norcal.usta.com/\" target=\"_blank\"> USTA NorCal</a> website.</p>\r\n         <p class=\"text-success\"> <strong> How do I join a CTC USTA League Tennis team?</strong></p>\r\n         <ul>\r\n             <li> Decide the level you wish to play (i.e. 2.5, 3.0 etc.). Your current USTA rating will help you decide. Determine your rating, if you do not have one, by using the USTA NorCal NTRP Self Rating Guidelines.</li>\r\n             <li> Check out the <a href=\"http://ctc.cupertinotennisclub.org/?p=33\">CTC Calendar </a> to learn about which teams are currently registering. </li>\r\n             <li> Contact the captain of the<a href=\"http://www.ustanorcal.com/organization.asp?id=113\" target=\"_blank\"> Cupertino team</a> you wish to play on and find out if the team needs players. </li>\r\n             <li> At the start of every season, teams have to be formed within a deadline. <a href=\"declare-play.php\"> Declare your interest/intent to play </a> at the start of each league season. </li>\r\n             <li> Please note you have to be an annual Cupertino Sports Center member, an annual USTA member and Cupertino Tennis Club Member to play tennis on a Club-sponsored USTA team at the Sports Center. </li>\r\n             <li> If you still have a question please email <a href=\"mailto:womensusta@cupertinotennisclub.org\">womensusta@cupertinotennisclub.org</a> or <a href=\"mailto:mensusta@cupertinotennisclub.org\">mensusta@cupertinotennisclub.org</a>.</li>\r\n         </ul> \r\n          \r\n          \r\n          <p> To learn more about the club or get more involved by being a member, <a href=\"contact.php\">contact </a> any member of the board. </p>\r\n        </div>','usta league','','inherit','closed','closed','','47-revision-v1','','','2015-08-25 01:03:08','2015-08-25 01:03:08','',47,'http://ctc.cupertinotennisclub.org/index.php/2015/08/25/47-revision-v1/',0,'revision','',0),(95,1,'2015-08-25 01:04:02','2015-08-25 01:04:02','<div class=\"col-xs-12 col-md-9\">\r\n    <h1> USTA League </h1>\r\n           <ul class=\"front-page-list\">\r\n            <li> What is USTA League Tennis?</li>\r\n            <li>How do I join a CTC USTA League Tennis team? </li>\r\n           </ul> \r\n         <p class=\"text-success\"> <strong> What is USTA League Tennis?</strong></p>\r\n         <p>The USTA League Tennis is the country\'s largest recreational tennis league, providing organized, structured team matches for more than 300,000 men and women of all ability levels. In Northern California, tennis is an integral part of life in Northern California, and teams can be found on courts in the Bay Area and Sacramento, Santa Clara to Marin to Mendocino Counties, as far north as Redding and as far south as Fresno. Teams are set up according to NTRP rating, so you\'re always sure that you\'ll be facing off against someone of comparable ability. That keeps the competition lively and the atmosphere social. Read more at <a href=\"http://www.norcal.usta.com/\" target=\"_blank\"> USTA NorCal</a> website.</p>\r\n         <p class=\"text-success\"> <strong> How do I join a CTC USTA League Tennis team?</strong></p>\r\n         <ul class=\"front-page-list\">\r\n             <li> Decide the level you wish to play (i.e. 2.5, 3.0 etc.). Your current USTA rating will help you decide. Determine your rating, if you do not have one, by using the USTA NorCal NTRP Self Rating Guidelines.</li>\r\n             <li> Check out the <a href=\"http://ctc.cupertinotennisclub.org/?p=33\">CTC Calendar </a> to learn about which teams are currently registering. </li>\r\n             <li> Contact the captain of the<a href=\"http://www.ustanorcal.com/organization.asp?id=113\" target=\"_blank\"> Cupertino team</a> you wish to play on and find out if the team needs players. </li>\r\n             <li> At the start of every season, teams have to be formed within a deadline. <a href=\"declare-play.php\"> Declare your interest/intent to play </a> at the start of each league season. </li>\r\n             <li> Please note you have to be an annual Cupertino Sports Center member, an annual USTA member and Cupertino Tennis Club Member to play tennis on a Club-sponsored USTA team at the Sports Center. </li>\r\n             <li