lub.org/membership-join/membership-registration/\">ONLINE APPLICATION</a>\n              </div>\n\n              <p> For more information, please send email to John Sperinde at <a href=\"mailto:membership@cupertinotennisclub.org\">Membership</a>. </p>\n           			</div>\n\n           		</div>','membership','','inherit','closed','closed','','35-autosave-v1','','','2015-11-24 21:42:44','2015-11-25 04:42:44','',35,'http://ctc.cupertinotennisclub.org/index.php/2015/08/26/35-autosave-v1/',0,'revision','',0),(128,1,'2015-08-26 00:25:31','2015-08-26 00:25:31','<div class=\"col-xs-12 col-md-12\">\r\n\r\n           		<h1>Membership Application </h1>\r\n              <p> Note for new members: <strong>Dual Membership Requirement</strong></p>\r\n              <p> <strong>Cupertino Sports Center (CSC)</strong> - for all Sport Center exercise, recreational and class participation. </p>\r\n              <p> <strong> Cupertino Tennis Center (CTC)</strong> - for Interclub and USTA league activities. </p>\r\n              <p> If you will be playing in the USTA League or the Women\'s Interclub League,\r\nyou must be an annual passholder of both the Cupertino Tennis Club (this application) and also the Cupertino Sports Center (CSC, the courts) before you can play in any match.\r\nThe CSC membership may be obtained at the front desk. </p>\r\n\r\n           		<ul> <p class=\"titles\"> Annual Dues: </p>\r\n              <li> $20 Resident </li>\r\n              <li> $25 Non-resident </li>\r\n              </ul> \r\n\r\n              <p> Memberships in CTC are for the calendar year ending December 31st. Therefore, before practicing in any new CTC calendar year events beginning in January, you will need to renew your CTC membership. </p> \r\n              \r\n              <div class=\"alert alert-success\" role=\"alert\">\r\n                  <a href=\"https://www.cupertinotennisclub.org/cgi-bin/apply15.cgi\" target=\"Top\" class=\"alert-link\">TO JOIN, OR RENEW MEMBERSHIP IN, THE CUPERT