15-09-24 15:42:45','[swpm_registration_form]','membership-join','','inherit','closed','closed','','279-revision-v1','','','2015-09-24 15:42:45','2015-09-24 15:42:45','',279,'http://ctc.cupertinotennisclub.org/279-revision-v1/',0,'revision','',0),(317,1,'2015-09-25 00:57:12','2015-09-25 00:57:12','<div class=\"col-xs-12 col-md-12\">\r\n\r\n           		<h1>Membership Application </h1>\r\n              <p> Note for new members: <strong>Dual Membership Requirement</strong></p>\r\n              <p> <strong>Cupertino Sports Center (CSC)</strong> - for all Sport Center exercise, recreational and class participation. </p>\r\n              <p> <strong> Cupertino Tennis Center (CTC)</strong> - for Interclub and USTA league activities. </p>\r\n              <p> If you will be playing in the USTA League or the Women\'s Interclub League, you must be an annual passholder of both the Cupertino Tennis Club (this application) and also the Cupertino Sports Center (CSC, the courts) before you can play in any match.The CSC membership may be obtained at the front desk. </p>\r\n\r\n           		<ul class=\"front-page-list\"> \r\n<p> <strong> Annual Dues:</strong> </p>\r\n              <li> $20 Resident </li>\r\n              <li> $25 Non-resident </li>\r\n              </ul> \r\n\r\n              <p> Memberships in CTC are for the calendar year ending December 31st. Therefore, before practicing in any new CTC calendar year events beginning in January, you will need to renew your CTC membership. </p> \r\n              \r\n              <div class=\"alert alert-success\" role=\"alert\">\r\n                  <a href=\"http://ctc.cupertinotennisclub.org/membership-join/membership-registration/\" target=\"Top\" class=\"alert-link\">TO JOIN THE CUPERTINO TENNIS CLUB FOR 2016, CLICK HERE TO COMPLETE THE ON-LINE MEMBERSHIP APPLICATION.</a>\r\n              </div>\r\n\r\n              <p> For more information, please send email to John Sperinde at <a href=\"mailto:membership@cupertinotennisclub.org\">Membership</a>. </p>\r\n           			</div>\r\n\r\n           		</div>','membership','','inherit','closed','closed','','35-revision-v1','','','2015-09-25 00:57:12','2015-09-25 00:57:12','',35,'http://ctc.cupertinotennisclub.org/35-revision-v1/',0,'revision','',0),(319,1,'2015-09-30 20:36:35','2015-09-30 20:36:35','<div class=\"col-xs-12 col-md-12\">\r\n\r\n           		<h1>Membership Application </h1>\r\n              <p> Note for new members: <strong>Dual Membership Requirement</strong></p>\r\n              <p> <strong>Cupertino Sports Center (CSC)</strong> - for all Sport Center exercise, recreational and class participation. </p>\r\n              <p> <strong> Cupertino Tennis Club (CTC)</strong> - for Interclub and USTA league activities. </p>\r\n              <p> If you will be playing in the USTA League or the Women\'s Interclub League, you must be an annual passholder of both the Cupertino Tennis Club (this application) and also the Cupertino Sports Center (CSC, the courts) before you can play in any match.The CSC membership may be obtained at the front desk. </p>\r\n\r\n           		<ul class=\"front-page-list\"> \r\n<p> <strong> Annual Dues:</strong> </p>\r\n              <li> $20 Resident </li>\r\n              <li> $25 Non-resident </li>\r\n              </ul> \r\n\r\n              <p> Memberships in CTC are for the calendar year ending December 31st. Therefore, before practicing in any new CTC calendar year events beginning in January, you will need to renew your CTC membership. </p> \r\n              \r\n              <div class=\"alert alert-success\" role=\"alert\">\r\n                  <a href=\"http://ctc.cupertinotennisclub.org/membership-join/membership-registration/\" target=\"Top\" class=\"alert-link\">TO JOIN THE CUPERTINO TENNIS CLUB FOR 2016, CLICK HERE TO COMPLETE THE ON-LINE MEMBERSHIP APPLICATION.</a>\r\n              </div>\r\n\r\n              <p> For more information, please send email to John Sperinde at <a href=\"mailto:membersh