E APPLICATION</a>\r\n              </div>\r\n\r\n              <p> For more information, please send email to John Sperinde at <a href=\"mailto:membership@cupertinotennisclub.org\">Membership</a>. </p>\r\n           			</div>\r\n\r\n           		</div>','membership','','inherit','closed','closed','','35-revision-v1','','','2015-10-02 22:00:04','2015-10-02 22:00:04','',35,'http://ctc.cupertinotennisclub.org/35-revision-v1/',0,'revision','',0),(335,1,'2015-10-08 23:54:14','2015-10-08 23:54:14','<div class=\"panel panel-default\">\r\n <div class=\"panel-body\">\r\n\r\n  <p>   The contact information contained in these pages is supplied by the members of the Club with the expectation that it will be used by individual members solely for purposes related to playing tennis, such as arranging matches, team practice, or other group practice sessions, etc. </p>\r\n\r\n<p>  Mass mailings are restricted to usage by board or committee members for general information or for club-wide functions such as leagues, socials, tournaments, etc. </p>\r\n\r\n<p> Any usage of this contact information by any member that is deemed improper by the CTC board of directors may result in suspension or dismissal from the Club. </p>\r\n\r\n<p> However, nothing in these Terms of Use is intended to inhibit members from contacting each other, either individually or in groups, when there would be a reasonable expectation of consent by the recipients.</p>\r\n\r\n<p> In other words, just keep doing what you have been doing all along, but spamming will be dealt with severely. </p>\r\n\r\n<p> Do you <strong>Agree</strong> to these Terms of Use? </p>\r\n <div class=\"application\">\r\n   <a class=\"btn btn-success\" href=\"http://ctc.cupertinotennisclub.org/membersterms/allmembersinfo/\">I AGREE</a>\r\n </div>\r\n<div class=\"application\">\r\n   <a class=\"btn btn-danger\" href=\"http://ctc.cupertinotennisclub.org/my-account/\">DISAGREE</a>\r\n </div>\r\n\r\n</div>\r\n</div>','membersterms','','publish','closed','closed','','membersterms','','','2015-10-12 19:58:21','2015-10-12 19:58:21','',0,'http://ctc.cupertinotennisclub.org/?page_id=335',0,'page','',0),(336,1,'2015-10-08 23:54:14','2015-10-08 23:54:14','Terms will be here','membersterms','','inherit','closed','closed','','335-revision-v1','','','2015-10-08 23:54:14','2015-10-08 23:54:14','',335,'http://ctc.cupertinotennisclub.org/335-revision-v1/',0,'revision','',0),(337,31,'2015-10-08 23:55:33','2015-10-08 23:55:33','<div class=\"col-md-12\">\r\n<h1>Interested in playing on a USTA league team?</h1>\r\nPlease use the green buttons (below) to declare your intent to play in your intended league(s).\r\n\r\nYou may declare your intent to play on either <strong>one</strong> or <strong>two</strong> teams per league.\r\n\r\nThere are three team types at CTC:\r\n<ul class=\"front-page-list\">\r\n	<li><strong>Competitive</strong> - This team strives to win the league, and will predominantly play only the best players.</li>\r\n	<li><strong>Recreational</strong> - This team is composed of players who are not at the top of their level, but still enjoy good competition.\r\nThis team might also be composed of a group of friends who just enjoy playing with each other.</li>\r\n	<li><strong>Developmental</strong> - This team is composed mostly of players who are \"playing up\" at a level above their rating.</li>\r\n</ul>\r\n<strong> You have to be a registered member on this website in order to Declare Intent to play USTA. </strong>\r\n\r\n[buttons]\r\n\r\n<div class=\"col-md-12\">\r\n<h4>Check below to see your name, and everyone else who has signed up.</h4>\r\n</div>\r\n<div class=\"col-md-6\">\r\n\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad40mix55/\">1. Adult 40 &amp; Mixed 55</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad65/\">2. Adult 65</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad18/\">3. Adult 18+ league</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalmix18ad55/\">4. Mixed 18 &amp; Adult 55</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad70/\">5. Adult 70</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalmix40combo/\">6. Mixed 40 &amp; Combo</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalcombodaytime/\">7. Women Daytime Combo</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/total40womendaytime/\">8. Daytime Adult 40 </a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/total18womendaytime/\">9. Women Daytime Adult 18 </a>\r\n<a href=\"https://ctc.cupertinotennisclub.org/total18-39singles/\">10. Adult 18-39 Singles </a>\r\n<a href=\"https://ctc.cupertinotennisclub.org/total18-39doubles/\">11. Adult 18-39 Doubles </a>\r\n\r\n\r\n</div>\r\n\r\n<div class=\"col-md-12\">\r\n\r\nIf you have questions about the teams or the league, or if you later find that you need to drop one (or both) teams, please send an email to the CTC <a href=\"mailto:USTA@cupertinotennisclub.org\">USTA coordinator.</a>\r\n\r\n</div>','declaretoplay','','publish','closed','closed','','declaretoplay','','','2018-10-05 12:43:00','2018-10-05 19:43:00','',0,'http://ctc.cupertinotennisclub.org/?page_id=337',0,'page','',0),(338,1,'2015-10-08 23:55:33','2015-10-08 23:55:33','Declare to play is coming soon','declaretoplay','','inherit','closed','closed','','337-revision-v1','','','2015-10-08 23:55:33','2015-10-08 23:55:33','',337,'http://ctc.cupertinotennisclub.org/337-revision-v1/',0,'revision','',0),(339,1,'2015-10-09 00:43:51','2015-10-09 00:43:51','<div class=\"panel panel-default\">\n <div class=\"panel-body\">\n\n  <p>   The contact information contained in these pages is supplied by the members of the Club with the expectation that it will be used by individual members solely for purposes related to playing tennis, such as arranging matches, team practice, or other group practice sessions, etc. </p>\n\n<p>  Mass mailings are restricted to usage by board or committee members for general information or for club-wide functions such as leagues