10-23 00:07:45','2015-10-23 00:07:45','<div class=\"col-md-12\">\r\n<h1> Interested in playing on a USTA league team? </h1>\r\n\r\n<p> Simply select the desired league below and you\'ll be presented with the appropriate form to submit. </p>\r\n\r\n<p> You may declare your intent to play on either <strong>one</strong> or <strong>two</strong> teams per league. </p>\r\n\r\n<p> There are three team types at CTC: </p>\r\n\r\n<ul class=\"front-page-list\">\r\n    <li><strong>Competitive</strong> - This team strives to win the league, and will predominantly play only the best players.</li>\r\n    <li><strong>Recreational</strong> - This team is composed of players who are not at the top of their level, but still enjoy good competition.\r\n   This team might also be composed of a group of friends who just enjoy playing with each other.</li>\r\n    <li><strong>Developmental</strong> - This team is composed mostly of players who are \"playing up\" at a level above their rating.</li>\r\n\r\n</ul>\r\n\r\n<p> <strong> NOTE: </strong> Beginning in 2014, there are two leagues running at exactly the same time. If you want to play in both leagues, you can only choose one team from each league (total of two teams max).</p>\r\n\r\n<div class=\"col-md-4\">\r\n  <a class=\"btn btn-success\" href=\"\">Adult 40 & Mixed 40</a>\r\n \r\n</div>\r\n<div class=\"col-md-4\">\r\n  <a class=\"btn btn-success\" href=\"\">Adult 65</a>\r\n \r\n</div>\r\n<div class=\"col-md-4\">\r\n  <a class=\"btn btn-success\" href=\"\">Adult 18+ league</a>\r\n \r\n</div>\r\n<div class=\"col-md-4\">\r\n  <a class=\"btn btn-success\" href=\"\">Mixed 18 & Adult 55</a>\r\n\r\n</div>\r\n<div class=\"col-md-4\">\r\n  <a class=\"btn btn-success\" href=\"\">Adult 70</a>\r\n \r\n</div>\r\n<div class=\"col-md-4\">\r\n  <a class=\"btn btn-success\" href=\"\">Mixed 55 & Combo</a>\r\n \r\n</div>\r\n\r\n</div>','declaretoplay','','inherit','closed','closed','','337-revision-v1','','','2015-10-23 00:07:45','2015-10-23 00:07:45','',337,'http://ctc.cupertinotennisclub.org/337-revision-v1/',0,'revision','',0),(362,1,'2015-10-23 00:10:29','2015-10-23 00:10:29','<div class=\"col-xs-12 col-md-8\">\r\n    <h1> USTA League </h1>\r\n    <img src=\"http://ctc.cupertinotennisclub.org/wp-content/uploads/2015/08/USTA_League-300x195.jpg\" alt=\"USTA League\" class=\"pull-left ustaimg\" />\r\n    \r\n           <ul class=\"front-page-list\">\r\n            <li> What is USTA League Tennis?</li>\r\n            <li>How do I join a CTC USTA League Team? </li>\r\n           </ul> \r\n</div>\r\n<div class=\"col-xs-12 col-md-4\">\r\n    \r\n            <ul class=\"ustalist\">\r\n                <li><a href=\"#\" target=\"_blank\"> DECLARE TO PLAY USTA</a> </li>\r\n                <li><a href=\"http://www.ustanorcal.com/organization.asp?id=113\" target=\"_blank\"> ALL CTC TEAMS</a> </li>\r\n                <li><a href=\"http://www.usta.com/Adult-Tennis/USTA-League/ntrp/\" target=\"_blank\"> USTA RATING</a>  </li>\r\n                <li> <a href=\"http://www.norcal.usta.com/adults/leagues/resources/\" target=\"_blank\">USTA GUIDE</a>  </li>\r\n                <li> <a href=\"http://ctc.cupertinotennisclub.org/?p=87\">FAQ</a>  </li>\r\n            </ul>  \r\n             \r\n</div>\r\n<div class=\"col-xs-12 col-md-12\">\r\n         <h4 class=\"question\"> <strong> What is USTA League Tennis?</strong></h4>\r\n         <p>The USTA League Tennis is the country\'s largest recreational tennis league, providing organized, structured team matches for more than 300,000 men and women of all ability levels. In Northern California, tennis is an integral part of life in Northern California, and teams can be found on courts in the Bay Area and Sacramento, Santa Clara to Marin to Mendocino Counties, as far north as Redding and as far south as Fresno. Teams are set up according to NTRP rating, so you\'re always sure that you\'ll be facing off against someone of comparable ability. That keeps the competition lively and the atmosphere social. Read more at <a href=\"http://www.norcal.usta.com/\" target=\"_blank\"> USTA NorCal</a> website.</p>\r\n         <h4 class=\"question\"> <strong> How do I join a CTC USTA League Tennis team?</strong></h4>\r\n         <ul class=\"front-page-list\">\r\n             <li> Decide the level you wish to play (i.e. 2.5, 3.0 etc.). Your current USTA rating will help you decide. Determine your rating, if you do not have one, by using the USTA NorCal NTRP Self Rating Guidelines.</li>\r\n             <li> Check out the <a href=\"http://ctc.cupertinotennisclub.org/?p=33\">CTC Calendar </a> to learn about which teams are currently registering. </li>\r\n             <li> Contact the captain of the<a href=\"http://www.ustanorcal.com/organization.asp?id=113\" target=\"_blank\"> Cupertino team</a> you wish to play on and find out if the team needs players. </li>\r\n             <li> At the start of every season, teams have to be formed within a deadline. <a href=\"declare-play.php\"> Declare your interest/intent to play </a> at the start of each league season. </li>\r\n             <li> Please note you have to be an annual Cupertino Sports Center member, an annual USTA member and Cupertino Tennis Club Member to play tennis on a Club-sponsored USTA team at the Sports Center. </li>\r\n             <li> If you still have a question please email <a href=\"mailto:womensusta@cupertinotennisclub.org\">womensusta@cupertinotennisclub.org</a> or <a href=\"mailto:mensusta@cupertinotennisclub.org\">mensusta@cupertinotennisclub.org</a>.</li>\r\n         </ul> \r\n          \r\n          \r\n          <p> To learn more about the club or get more involved by being a member, <a href=\"contact.php\">contact </a> any member of the board. </p>\r\n</div>\r\n\r\n','usta league','','inherit','closed','closed','','47-revision-v1','','','2015-10-23 00:10:29','2015-10-23 00:10:29','',47,'http://ctc.cupertinotennisclub.org/47-revision-v1/',0,'revision','',0),(363,1,'2015-10-23 00:12:44','2015-10-23 00:12:44','<div class=\"col-xs-12 col-md-8\">\r\n    <h1> USTA League </h1>\r\n      <ul class=\"front-page-list\">\r\n         <li> What is USTA League Tennis?</li>\r\n         <li>How do I join a CTC USTA League Team? </li>\r\n      </ul> \r\n</div>\r\n<div class=\"col-xs-12 col-md-4\">\r\n    \r\n            <ul class=\"ustalist\">\r\n                <li><a href=\"#\" target=\"_blank\"> DECLARE TO PLAY USTA</a> </li>\r\n                <li><a href=\"http://www.ustanorcal.com/organization.asp?id=113\" target=\"_blank\"> ALL CTC TEAMS</a> </li>\r\n                <li><a href=\"http://www.usta.com/Adult-Tennis/USTA-League/ntrp/\" target=\"_blank\"> USTA RATING</a>  </li>\r\n                <li> <a href=\"http://www.norcal.usta.com/adults/leagues/resources/\" target=\"_blank\">USTA GUIDE</a>  </li>\r\n                <li> <a href=\"http://ctc.cupertinotennisclub.org/?p=87\">FAQ</a>  </li>\r\n            </ul>  \r\n             \r\n</div>\r\n<div class=\"col-xs-12 col-md-12\">\r\n         <h4 class=\"question\"> <strong> What is USTA League Tennis?</strong></h4>\r\n         <img src=\"http://ctc.cupertinotennisclub.org/wp-content/uploads/2015/08/USTA_League-300x195.jpg\" alt=\"USTA League\" class=\"pull-left ustaimg\" />\r\n<p>The USTA League Tennis is the country\'s largest recreational tennis league, providing organized, structured team matches for more than 300,000 men and women of all ability levels. In Northern California, tennis is an integral part of life in Northern California, and teams can be found on courts in the Bay Area and Sacramento, Santa Clara to Marin to Mendocino Counties, as far north as Redding and as far south as Fresno. Teams are set up according to NTRP rating, so you\'re always sure that you\'ll be facing off against someone of comparable ability. That keeps the competition lively and the atmosphere social. Read more at <a href=\"http://www.norcal.usta.com/\" target=\"_blank\"> USTA NorCal</a> website.</p>\r\n         <h4 class=\"question\"> <strong> How do I join a CTC USTA League Tennis team?</strong></h4>\r\n         <ul class=\"front-page-list\">\r\n             <li> Decide the level you wish to play (i.e. 2.5, 3.0 etc.). Your current USTA rating will help you decide. Determine your rating, if you do not have one, by using the USTA NorCal NTRP Self Rating Guidelines.</li>\r\n             <li> Check out the <a href=\"http://ctc.cupertinotennisclub.org/?p=33\">CTC Calendar </a> to learn about which teams are currently registering. </li>\r\n             <li> Contact the captain of the<a href=\"http://www.ustanorcal.com/organization.asp?id=113\" target=\"_blank\"> Cupertino team</a> you wish to play on and find out if the team needs players. </li>\r\n             <li> At the start of every season, teams have to be formed within a deadline. <a href=\"declare-play.php\"> Declare your interest/intent to play </a> at the start of each league season. </li>\r\n             <li> Please note you have to be an annual Cupertino Sports Center member, an annual USTA member and Cupertino Tennis Club Member to play tennis on a Club-sponsored USTA team at the Sports Center. </li>\r\n             <li> If you still have a question please email <a href=\"mailto:womensusta@cupertinotennisclub.org\">womensusta@cupertinotennisclub.org</a> or <a href=\"mailto:mensusta@cupertinotennisclub.org\">mensusta@cupertinotennisclub.org</a>.</li>\r\n         </ul> \r\n          \r\n          \r\n          <p> To learn more about the club or get more involved by being a member, <a href=\"contact.php\">contact </a> any member of the board. </p>\r\n</div>\r\n\r\n','usta league','','inherit','closed','closed','','47-revision-v1','','','2015-10-23 00:12:44','2015-10-23 00:12:44','',47,'http://ctc.cupertinotennisclub.org/47-revision-v1/',0,'revision','',0),(364,1,'2015-10-23 00:18:21','2015-10-23 00:18:21','<div class=\"col-xs-12 col-md-8\">\r\n    <h1> USTA League </h1>\r\n      <ul class=\"front-page-list\">\r\n         <li> What is USTA 