Mixed 55 & Combo</a>\r\n \r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-12\">\r\n  <h4> Check below to see your name, and everyone else who has signed up. </h4>\r\n    <a href=\"http://ctc.cupertinotennisclub.org/totalad40mix40/\">1. Adult 40 & Mixed 40</a>\r\n    <a href=\"http://ctc.cupertinotennisclub.org/totalad65/\">2. Adult 65</a>\r\n    <a href=\"http://ctc.cupertinotennisclub.org/totalad18/\">3. Adult 18+ league</a>\r\n    <a href=\"http://ctc.cupertinotennisclub.org/totalmix18ad55/\">4. Mixed 18 & Adult 55</a>\r\n    <a href=\"http://ctc.cupertinotennisclub.org/totalad70/\">5. Adult 70</a>\r\n    <a href=\"http://ctc.cupertinotennisclub.org/totalmix55combo/\">6. Mixed 55 & Combo</a>\r\n</div>\r\n\r\n<div class=\"col-md-12\">\r\n  <p>If you have questions about this process or the need for it, or about the teams or the league, or if you later find that you need to drop one (or both) teams, please send an email to the CTC <a href=\"mailto:USTA@cupertinotennisclub.org\">USTA coordinator.</a>\r\n  </p>\r\n</div>\r\n\r\n','declaretoplay','','inherit','closed','closed','','337-revision-v1','','','2015-10-28 12:57:19','2015-10-28 19:57:19','',337,'http://ctc.cupertinotennisclub.org/337-revision-v1/',0,'revision','',0),(425,1,'2015-10-28 12:58:43','2015-10-28 19:58:43','<div class=\"col-md-8\">\r\n<h1>Welcome to the Cupertino Tennis Club!</h1>\r\nThe Cupertino Tennis Club is co-sponsored by the City of Cupertino. The club utilizes the Cupertino Sports Center for tournaments, most league play, socials and other events.\r\n\r\nCTC provides both competitive and social tennis playing opportunities to its members.\r\n\r\nHere are a few ways to get started with playing tennis and meeting people!\r\n<ul class=\"front-page-list\">\r\n	<li>Join one or more Cupertino Tennis Teams to play in a USTA League.</li>\r\n	<li>Meet new tennis friends playing morning Women\'s Interclub or Men\'s drop in tennis every Mon/Wed/Fri at 12:00pm.</li>\r\n	<li>Contact volunteers who are happy to set up games and introduce you to others.</li>\r\n	<li>Drop in tennis is every Friday night at 6:45 pm conducted by the Cupertino Sports Center.</li>\r\n</ul>\r\n\r\n<address>\r\n  <strong>Cupertino Sports Center</strong><br>\r\n  21111 Stevens Creek Blvd, Cupertino, CA 95014<br>\r\n  <abbr title=\"Phone\">P:</abbr> (408) 777-3160\r\n</address>\r\n<div class=\"thumbnail\"><iframe style=\"border: 0;\" src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3172.799658505789!2d-122.04275199999998!3d37.323572999999996!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x808fb44dc125cec7%3A0x9e30b79f6e4ecc9c!2sCupertino+Sports+Center!5e0!3m2!1sen!2sus!4v1440454038035\" width=\"100%\" height=\"300\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe>\r\n</div>\r\n</div>\r\n<div class=\"col-md-4\">\r\n<div class=\"thumbnail sidebarright\">\r\n<a href=\"http://ctc.cupertinotennisclub.org/declaretoplay/\">\r\n<img class=\"img-responsive thumbnail sidebarimage\" src=\"http://ctc.cupertinotennisclub.org/wp-content/uploads/2015/08/mainbaner.jpg\" alt=\"Declare to Play USTA\" />\r\nDeclare to play USTA</a>\r\n</div>\r\n<div class=\"thumbnail sidebarright\"><a href=\"http://ctc.cupertinotennisclub.org/?p=35\">\r\n<img class=\"img-responsive thumbnail sidebarimage\" src=\"http://ctc.cupertinotennisclub.org/wp-content/uploads/2015/08/membership.jpg\" alt=\"Membership Application\" />\r\nMembership Application</a></div>\r\n<div class=\"thumbnail sidebarright\"><a href=\"http://ctc.cupertinotennisclub.org/?p=45\">\r\n<img class=\"img-responsive thumbnail sidebarimage\" src=\"http://ctc.cupertinotennisclub.org/wp-content/uploads/2015/08/interclub.jpg\" alt=\"Interclub\" />\r\nInterclub</a></div>\r\n</div>','home','','inherit','closed','closed','','14-revision-v1','','','2015-10-28 12:58:43','2015-10-28 19:58:43','',14,'http://ctc.cupertinotennisclub.org/14-revision-v1/',0,'revision','',0),(426,1,'2015-10-28 16:32:03','2015-10-28 23:32:03','','Adult40mixed40'