ng> - This team is composed of players who are not at the top of their level, but still enjoy good competition.\r\n   This team might also be composed of a group of friends who just enjoy playing with each other.</li>\r\n    <li><strong>Developmental</strong> - This team is composed mostly of players who are \"playing up\" at a level above their rating.</li>\r\n\r\n</ul>\r\n\r\n<div class=\"intent\">\r\n<div class=\"col-md-4\">\r\n  <a class=\"btn btn-success\" href=\"http://ctc.cupertinotennisclub.org/adult40mixed40/\">Adult 40 & Mixed 40</a>\r\n \r\n</div>\r\n<div class=\"col-md-4\">\r\n  <a class=\"btn btn-success\" href=\"http://ctc.cupertinotennisclub.org/adult65/\">Adult 65</a>\r\n \r\n</div>\r\n<div class=\"col-md-4\">\r\n  <a class=\"btn btn-success\" href=\"http://ctc.cupertinotennisclub.org/adult18/\">Adult 18+ league</a>\r\n \r\n</div>\r\n<div class=\"col-md-4\">\r\n  <a class=\"btn btn-success\" href=\"http://ctc.cupertinotennisclub.org/mixed18adult55/\">Mixed 18 & Adult 55</a>\r\n\r\n</div>\r\n<div class=\"col-md-4\">\r\n  <a class=\"btn btn-success\" href=\"http://ctc.cupertinotennisclub.org/adult70/\">Adult 70</a>\r\n \r\n</div>\r\n<div class=\"col-md-4\">\r\n  <a class=\"btn btn-success\" href=\"http://ctc.cupertinotennisclub.org/mixed55combo/\">Mixed 55 & Combo</a>\r\n \r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-12\">\r\n  <h4> Check below to see your name, and everyone else who has signed up. </h4>\r\n    <a href=\"http://ctc.cupertinotennisclub.org/totalad40mix40/\">1. Adult 40 & Mixed 40</a>\r\n    <a href=\"http://ctc.cupertinotennisclub.org/totalad65/\">2. Adult 65</a>\r\n    <a href=\"http://ctc.cupertinotennisclub.org/totalad18/\">3. Adult 18+ league</a>\r\n    <a href=\"http://ctc.cupertinotennisclub.org/totalmix18ad55/\">4. Mixed 18 & Adult 55</a>\r\n    <a href=\"http://ctc.cupertinotennisclub.org/totalad70/\">5. Adult 70</a>\r\n    <a href=\"http://ctc.cupertinotennisclub.org/totalmix55combo/\">6. Mixed 55 & Combo</a>\r\n</div>\r\n\r\n<div class=\"col-md-12\">\r\n  <p>If you have questions about this process or the need for it, or about the teams or the league, or if you later find that you need to drop one (or both) teams, please send an email to the CTC <a href=\"mailto:USTA@cupertinotennisclub.org\">USTA coordinator.</a>\r\n  </p>\r\n</div>\r\n\r\n','declaretoplay','','inherit','closed','closed','','337-revision-v1','','','2015-11-21 22:32:04','2015-11-22 05:32:04','',337,'http://ctc.cupertinotennisclub.org/337-revision-v1/',0,'revision','',0),(462,1,'2015-11-21 22:36:28','2015-11-22 05:36:28','<div class=\"col-md-12\">\r\n<h1> Interested in playing on a USTA league team? </h1>\r\n\r\n<p> Please use the green button below to declare your intent to play in your intended league(s). </p>\r\n\r\n<p> You may declare your intent to play on either <strong>one</strong> or <strong>two</strong> teams per league. </p>\r\n\r\n<p> There are three team types at CTC: </p>\r\n\r\n<ul class=\"front-page-list\">\r\n    <li><strong>Competitive</strong> - This team strives to win the league, and will predominantly play only the best players.</li>\r\n    <li><strong>Recreational</strong> - This team is composed of players who are not at the top of their level, but still enjoy good competition.\r\n   This team might also be composed of a group of friends who just enjoy playing with each other.</li>\r\n    <li><strong>Developmental</strong> - This team is composed mostly of players who are \"playing up\" at a level above their rating.</li>\r\n\r\n</ul>\r\n<p> <strong> You have to be a member of this website in order to declare intent to play USTA. Please, submit the application form and use your login and password to log into the website.  </strong></p>\r\n<div class=\"intent\">\r\n<div class=\"col-md-4\">\r\n  <a class=\"btn btn-success\" href=\"http://ctc.cupertinotennisclub.org/adult40mixed40/\">Adult 40 & Mixed 40</a>\r\n \r\n</div>\r\n<div class=\"col-md-4\">\r\n  <a class=\"btn btn-success\" href=\"http