ut still enjoy good competition.\r\n   This team might also be composed of a group of friends who just enjoy playing with each other.</li>\r\n    <li><strong>Developmental</strong> - This team is composed mostly of players who are \"playing up\" at a level above their rating.</li>\r\n\r\n</ul>\r\n<p> <strong> You have to be a member of this website in order to declare intent to play USTA.  </strong></p>\r\n<div class=\"intent\">\r\n<div class=\"col-md-4\">\r\n  <a class=\"btn btn-success\" href=\"http://ctc.cupertinotennisclub.org/adult40mixed40/\">Adult 40 & Mixed 40</a>\r\n \r\n</div>\r\n<div class=\"col-md-4\">\r\n  <a class=\"btn btn-success\" href=\"http://ctc.cupertinotennisclub.org/adult65/\">Adult 65</a>\r\n \r\n</div>\r\n<div class=\"col-md-4\">\r\n  <a class=\"btn btn-success\" href=\"http://ctc.cupertinotennisclub.org/adult18/\">Adult 18+ league</a>\r\n \r\n</div>\r\n<div class=\"col-md-4\">\r\n  <a class=\"btn btn-success\" href=\"http://ctc.cupertinotennisclub.org/mixed18adult55/\">Mixed 18 & Adult 55</a>\r\n\r\n</div>\r\n<div class=\"col-md-4\">\r\n  <a class=\"btn btn-success\" href=\"http://ctc.cupertinotennisclub.org/adult70/\">Adult 70</a>\r\n \r\n</div>\r\n<div class=\"col-md-4\">\r\n  <a class=\"btn btn-success\" href=\"http://ctc.cupertinotennisclub.org/mixed55combo/\">Mixed 55 & Combo</a>\r\n \r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-12\">\r\n  <h4> Check below to see your name, and everyone else who has signed up. </h4>\r\n    <a href=\"http://ctc.cupertinotennisclub.org/totalad40mix40/\">1. Adult 40 & Mixed 40</a>\r\n    <a href=\"http://ctc.cupertinotennisclub.org/totalad65/\">2. Adult 65</a>\r\n    <a href=\"http://ctc.cupertinotennisclub.org/totalad18/\">3. Adult 18+ league</a>\r\n    <a href=\"http://ctc.cupertinotennisclub.org/totalmix18ad55/\">4. Mixed 18 & Adult 55</a>\r\n    <a href=\"http://ctc.cupertinotennisclub.org/totalad70/\">5. Adult 70</a>\r\n    <a href=\"http://ctc.cupertinotennisclub.org/totalmix55combo/\">6. Mixed 55 & Combo</a>\r\n</div>\r\n\r\n<div class=\"col-md-12\">\r\n  <p>If you have questions about this process or the need for it, or about the teams or the league, or if you later find that you need to drop one (or both) teams, please send an email to the CTC <a href=\"mailto:USTA@cupertinotennisclub.org\">USTA coordinator.</a>\r\n  </p>\r\n</div>\r\n\r\n','declaretoplay','','inherit','closed','closed','','337-revision-v1','','','2015-11-21 22:49:07','2015-11-22 05:49:07','',337,'http://ctc.cupertinotennisclub.org/337-revision-v1/',0,'revision','',0),(465,1,'2015-11-23 09:32:03','2015-11-23 16:32:03','<div class=\"col-xs-12 col-md-8\">\r\n    <h1> USTA League </h1>\r\n      <ul class=\"front-page-list\">\r\n         <li> What is USTA League Tennis?</li>\r\n         <li>How do I join a CTC USTA League Team? </li>\r\n      </ul> \r\n</div>\r\n<div class=\"col-xs-12 col-md-4\">\r\n    \r\n            <ul class=\"ustalist\">\r\n                <li><a href=\"http://ctc.cupertinotennisclub.org/declaretoplay/\"> DECLARE TO PLAY USTA</a> </li>\r\n                <li><a href=\"http://www.ustanorcal.com/organization.asp?id=113\" target=\"_blank\"> ALL CTC TEAMS</a> </li>\r\n                <li><a href=\"http://www.usta.com/Adult-Tennis/USTA-League/ntrp/\" target=\"_blank\"> USTA RATING</a>  </li>\r\n                <li> <a href=\"http://www.norcal.usta.com/adults/leagues/resources/\" target=\"_blank\">USTA GUIDE</a>  </li>\r\n                <li> <a href=\"http://ctc.cupertinotennisclub.org/?p=87\">FAQ</a>  </li>\r\n            </ul>  \r\n             \r\n</div>\r\n<div class=\"col-xs-12 col-md-12\">\r\n         <h4 class=\"question\"> <strong> What is USTA League Tennis?</strong></h4>\r\n         <img src=\"http://ctc.cupertinotennisclub.org/wp-content/uploads/2015/08/USTA_League-300x195.jpg\" alt=\"USTA League\" class=\"pull-left ustaimg\" />\r\n<p>The USTA League Tennis is the country\'s largest recreational tennis league, providing organized, structured team matches for more than 300,000 men and women of all ability levels. In Northern California, tennis is an integral part of life in Northern California, and teams can be found on courts in the Bay Area and Sacramento, Santa Clara to Marin to Mendocino Counties, as far north as Redding and as far south as Fresno. Teams are set up according to NTRP rating, so you\'re always sure that you\'ll be facing off against someone of comparable ability. That keeps the competition lively and the atmosphere social. Read more at <a href=\"http://www.norcal.usta.com/\" target=\"_blank\"> USTA NorCal</a> website.</p>\r\n         <h4 class=\"question\"> <strong> How do I join a CTC USTA League Tennis team?</strong></h4>\r\n         <ul class=\"front-page-list\">\r\n             <li> Decide the level you wish to play (i.e. 2.5, 3.0 etc.). Your current USTA rating will help you decide. Determine your rating, if you do not have one, by using the USTA NorCal NTRP Self Rating Guidelines.</li>\r\n             <li> Check out the <a href=\"http://ctc.cupertinotennisclub.org/?p=33\">CTC Calendar </a> to learn about which teams are currently registering. </li>\r\n             <li> Contact the captain of the<a href=\"http://www.ustanorcal.com/organization.asp?id=113\" target=\"_blank\"> Cupertino team</a> you wish to play on and find out if the team needs players. </li>\r\n             <li> At the start of every season, teams have to be formed within a deadline. <a href=\"http://ctc.cupertinotennisclub.org/declaretoplay/\"> Declare your interest/intent to play </a> at the start of each league season. </li>\r\n             <li> Please note you have to be an annual Cupertino Sports Center member, an annual USTA member and Cupertino Tennis Club Member to play tennis on a Club-sponsored USTA team at the Sports Center. </li>\r\n             <li> If you still have a question please email <a href=\"mailto:womensusta@cupertinotennisclub.org\">womensusta@cupertinotennisclub.org</a> or <a href=\"mailto:mensusta@cupertinotennisclub.org\">mensusta@cupertinotennisclub.org</a>.</li>\r\n         </ul> \r\n          \r\n          \r\n          <p> To learn more about the club or get more involved by being a member, <a href=\"contact.php\">contact </a> any member of the board. </p>\r\n</div>\r\n','usta league','','inherit','closed','closed','','47-revision-v1','','','2015-11-23 09:32:03','2015-11-23 16:32:03','',47,'http://ctc.cupertinotennisclub.org/47-revision-v1/',0,'revision','',0),(466,1,'2015-11-23 09:34:16','2015-11-23 16:34:16','<div class=\"col-xs-12 col-md-8\">\r\n    <h1> USTA League </h1>\r\n      <ul class=\"front-page-list\">\r\n         <li> What is USTA League Tennis?</li>\r\n         <li>How do I join a CTC USTA League Team? </li>\r\n      </ul> \r\n</div>\r\n<div class=\"col-xs-12 col-md-4\">\r\n    \r\n            <ul class=\"ustalist\">\r\n                <li><a href=\"http://ctc.cupertinotennisclub.org/declaretoplay/\"> DECLARE TO PLAY USTA</a> </li>\r\n                <li><a href=\"http://www.ustanorcal.com/organization.asp?id=113\" target=\"_blank\"> ALL CTC TEAMS</a> </li>\r\n                <li><a href=\"http://www.usta.com/Adult-Tennis/USTA-League/ntrp/\" target=\"_blank\"> USTA RATING</a>  </li>\r\n                <li> <a href=\"http://www.norcal.usta.com/adults/leagues/resources/\" target=\"_blank\">USTA GUIDE</a>  </li>\r\n                <li> <a href=\"http://ctc.cupertinotennisclub.org/?p=87\">FAQ</a>  </li>\r\n            </ul>  \r\n             \r\n</div>\r\n<div class=\"col-xs-12 col-md-12\">\r\n         <h4 class=\"question\"> <strong> What is USTA League Tennis?</strong></h4>\r\n         <img src=\"http://ctc.cupertinotennisclub.org/wp-content/uploads/2015/08/USTA_League-300x195.jpg\" alt=\"USTA League\" class=\"pull-left ustaimg\" />\r\n<p>The USTA League Tennis is the country\'s largest recreational tennis league, providing organized, structured team matches for more than 300,000 men and women of all ability levels. In Northern California, tennis is an integral part of life in Northern California, and teams can be found on courts in the Bay Area and Sacramento, Santa Clara to Marin to Mendocino Counties, as far north as Redding and as far south as Fresno. Teams are set up according to NTRP rating, so you\'re always sure that you\'ll be facing off against someone of comparable ability. That keeps the competition lively and the atmosphere social. Read more at <a href=\"http://www.norcal.usta.com/\" target=\"_blank\"> USTA NorCal</a> website.</p>\r\n         <h4 class=\"question\"> <strong> How do I join a CTC USTA League Tennis team?</strong></h4>\r\n         <ul class=\"front-page-list\">\r\n             <li> Decide the level you wish to play (i.e. 2.5, 3.0 etc.). Your current USTA rating will help you decide. Determine your rating, if you do not have one, by using the USTA NorCal NTRP Self Rating Guidelines.</li>\r\n             <li> Check out the <a href=\"http://ctc.cupertinotennisclub.org/?p=33\">CTC Calendar </a> to learn about which teams are currently registering. </li>\r\n             <li> Contact the captain of the<a href=\"http://www.ustanorcal.com/organization.asp?id=113\" target=\"_blank\"> Cupertino team</a> you wish to play on and find out if the team needs players. </li>\r\n             <li> At the start of every season, teams have to be formed within a deadline. <a href=\"http://ctc.cupertinotennisclub.org/declaretoplay/\"> Declare your interest/intent to play </a> at the start of each league season. </li>\r\n             <li> Please note you have to be an annual Cupertino Sports Center member, an annual USTA member and Cupertino Tennis Club Member to play tennis on a Club-sponsored USTA team at the Sports Center. </li>\r\n             <li> If you still have a question please email <a href=\"mailto:womensusta@cupertinotennisclub.org\">womensusta@cupertinotennisclub.org</a> or <a href=\"mailto:mensusta@cupertinotennisclub.org\">mensusta@cupertinotennisclub.org</a>.</li>\r\n         </ul> \r\n          \r\n          \r\n          <p> To learn more about the club or get more involved by being a member, <a href=\"http://ctc.cupertinotennisclub.org/contact/\">contact us </a>. </p>\r\n</div>','usta league','','inherit','closed','closed','','47-revision-v1','','','2015-11-23 09:34:16','2015-11-23 16:34:16','',47,'http://ctc.cupertinotennisclub.org/47-revision-v1/',0,'revision','',0),(467,1,'2015-11-23 23:04:10','2015-11-24 06:04:10','','memberstotal','','publish','closed','closed','','memberstotal','','','2015-11-23 23:04:55','2015-11-24 06:04:55','',0,'http://ctc.cupertinotennisclub.org/?page_id=467',0,'page','',0),(468,1,'2015-11-23 23:04:10','2015-11-24 06:04:10','','memberstotal','','inherit','closed','closed','','467-revision-v1','','','2015-11-23 23:04:10','2015-11-24 06:04:10','',467,'http://ctc.cupertinotennisclub.org/467-revision-v1/',0,'revision','',0),(469,1,'2015-11-24 21:42:45','2015-11-25 04:42:45','<div class=\"col-xs-12 col-md-12\">\r\n\r\n           		<h1>Membership Application </h1>\r\n              <p> Note for new members: <strong>Dual Membership Requirement *</strong></p>\r\n              <p> <strong>Cupertino Sports Center (CSC)</strong> - the physical Tennis Courts. </p>\r\n              <p> <strong> Cupertino Tennis Club (CTC)</strong> - for Interclub and USTA league activities. </p>\r\n              <p> <strong>*</strong> If you will be playing in the USTA League or in the Womens Interclub League, you must be both an annual passholder at the CSC (the courts) and also a member of the Cupertino Tennis Club (this application), before you may play in any match. The CSC membership may be obtained at the front desk. </p>\r\n\r\n           		<ul class=\"front-page-list\"> \r\n<p> <strong> Annual Dues:</strong> </p>\r\n              <li> $20 Resident </li>\r\n              <li> $25 Non-resident </li>\r\n              </ul> \r\n\r\n              <p> Memberships in CTC are for the calendar year ending December 31st. Therefore, before participating in either of these leagues in the new calendar year beginning in January, you will need to renew your CTC membership. </p> \r\n              <p> To Join the Cupertino Tennis Club, click below to complete the online Membership Application. </p>\r\n              \r\n              \r\n              <div class=\"application\">\r\n                  <a class=\"btn btn-success\" href=\"http://ctc.cupertinotennisclub.org/membership-join/membership-registration/\">ONLINE APPLICATION</a>\r\n              </div>\r\n\r\n              <p> For more information, please send email to John Sperinde at <a href=\"mailto:membership@cupertinotennisclub.org\">Membership</a>. </p>\r\n           			</div>\r\n\r\n           		</div>','membership','','inherit','closed','closed','','35-revision-v1','','','2015-11-24 21:42:45','2015-11-25 04:42:45','',35,'http://ctc.cupertinotennisclub.org/35-revision-v1/',0,'revision','',0),(470,1,'2015-11-25 08:49:28','2015-11-25 15:49:28','<div class=\"col-md-8\">\r\n<h1>Welcome to the Cupertino Tennis Club!</h1>\r\nThe Cupertino Tennis Club is co-sponsored by the City of Cupertino. The club utilizes the Cupertino Sports Center for most league play, socials and other events.\r\n\r\nCTC provides both competitive and social tennis playing opportunities to its members.\r\n\r\nHere are a few ways to get started with playing tennis and meeting people!\r\n<ul class=\"front-page-list\">\r\n	<li>Join one or more Cupertino Tennis Teams to play in a USTA League.</li>\r\n	<li>Meet new tennis friends playing morning Women\'s Interclub or Men\'s drop in tennis every Mon/Wed/Fri at 12:00pm.</li>\r\n	<li>Contact volunteers who are happy to set up games and introduce you to others.</li>\r\n	<li>Drop in tennis is every Friday night at 6:45 pm conducted by the Cupertino Sports Center.</li>\r\n</ul>\r\n\r\n<address>\r\n  <strong>Cupertino Sports Center</strong><br>\r\n  21111 Stevens Creek Blvd, Cupertino, CA 95014<br>\r\n  <abbr title=\"Phone\">P:</abbr> (408) 777-3160\r\n</