</li>\r\n	\r\n</ul>\r\n<address><strong>Cupertino Sports Center</strong>\r\n21111 Stevens Creek Blvd, Cupertino, CA 95014\r\n<abbr title=\"Phone\">P:</abbr> (408) 777-3160</address>\r\n<div class=\"thumbnail\"><iframe style=\"border: 0;\" src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3172.799658505789!2d-122.04275199999998!3d37.323572999999996!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x808fb44dc125cec7%3A0x9e30b79f6e4ecc9c!2sCupertino+Sports+Center!5e0!3m2!1sen!2sus!4v1440454038035\" width=\"100%\" height=\"300\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>\r\n<div class=\"col-md-4\">\r\n<div class=\"thumbnail sidebarright\"><a href=\"http://ctc.cupertinotennisclub.org/declaretoplay/\">\r\n<img class=\"img-responsive thumbnail sidebarimage\" src=\"http://ctc.cupertinotennisclub.org/wp-content/uploads/2015/08/mainbaner.jpg\" alt=\"Declare to Play USTA\" />\r\nDeclare to play USTA</a></div>\r\n<div class=\"thumbnail sidebarright\"><a href=\"http://ctc.cupertinotennisclub.org/?p=35\">\r\n<img class=\"img-responsive thumbnail sidebarimage\" src=\"http://ctc.cupertinotennisclub.org/wp-content/uploads/2015/08/membership.jpg\" alt=\"Membership Application\" />\r\nMembership Application</a></div>\r\n<div class=\"thumbnail sidebarright\"><a href=\"http://ctc.cupertinotennisclub.org/?p=45\">\r\n<img class=\"img-responsive thumbnail sidebarimage\" src=\"http://ctc.cupertinotennisclub.org/wp-content/uploads/2015/08/interclub.jpg\" alt=\"Interclub\" />\r\nInterclub</a></div>\r\n</div>','home','','inherit','closed','closed','','14-revision-v1','','','2015-11-26 11:18:10','2015-11-26 18:18:10','',14,'http://ctc.cupertinotennisclub.org/14-revision-v1/',0,'revision','',0),(487,25,'2020-08-11 19:05:59','2020-08-12 02:05:59','<div class=\"col-xs-12 col-md-12\">\n            <h1>CTC Activities</h1>\n              <p> If you\'re interested in tennis classes at Cupertino Sports Center, please check Lifetime Tennis website <a href=\"https://www.lifetimeactivities.com/cupertino/\">here</a>, or contact them directly at 408-777-3169. </p>\n              <p> The Cupertino Tennis Club in addition to USTA League teams, sponsor the the following activities: </p>\n              <ul class=\"front-page-list\">\n                <li> Women\'s Interclub. </li>\n                <li> Socials. </li>\n              </ul>  \n              \n              <p> <strong>  WOMEN\'S INTERCLUB </strong> <p>\n              <p> For those of you who have never played Women\'s Interclub, Interclub is a social/casual league where members from the Cupertino Tennis Club play with other clubs in the area. After playing, the group will enjoy lunch with the opponents. </p>  \n              <p> Interclub matches are played in the mornings, September through May with most of December off, and usually consist of four or five doubles matches. The playing level is usually between 3.0 and 4.0. There is no fee to play, and this is NOT a USTA sanctioned event.<p>\n              <p> The club now has three levels of women\'s interclub: 3.0, 3.5 and 4.0. &nbsp; If you are interested in playing, please contact the team captain(s) either directly or by clicking on their names for a current schedule of dates. </p>\n                <div class=\"table-responsive\">\n                  <table class=\"table table-hover table-bordered\">\n                      <thead>\n                          <tr class=\"success\">\n                               <th>Level</th>\n                               <th>Contact/Email</th>\n                          </tr>  \n                      </thead> \n                      <tbody>\n                           <tr>\n                               <th>3.5 level</th>\n                               <th><a href=\"mailto:womensinterclub35@cupertinotennisclub.org\"> Grace Haig </a></th>\n                          </tr>\n                           <tr>\n                               <th>4.0 level</th>\n                               <th><a href=\"mailto:womensinterclub40@cupertinotennisclub.org\"> Joan Hu </a></th>\n                          </tr>\n\n                      </tbody> \n                  </table>\n                </div>\n              <p> <strong> SOCIALS </strong> <p>\n              <p> Socials are scheduled throughout the year depending on court availability and interest. Your ideas and suggestions are always welcome, please contact Analiza Dolor at <a href=\"mailto:Socials@CupertinoTennisClub.org\">Socials</a>.</p>\n              <p> The Annual meeting is scheduled for early December each year. It is usually held off-site with pizza, drinks and dessert followed by--or prior to--the annual meeting and election of new board members. </p>\n              <p> More information prior to each event will be published in the Newsletter and on our Home Page. </p>\n              <p> Want to run, or help with, a social? Have questions? Contact the <a href=\"mailto:Socials@Cupertinotennisclub.org\">Socials Director</a>. </p>\n\n        </div>','Club Activities','','inherit','closed','closed','','45-autosave-v1','','','2020-08-11 19:05:59','2020-08-12 02:05:59','',45,'http://ctc.cupertinotennisclub.org/45-autosave-v1/',0,'revision','',0),(488,25,'2015-11-26 11:36:59','2015-11-26 18:36:59','<div class=\"col-xs-12 col-md-12\">\r\n            <h1>CTC Activities</h1>\r\n              <p> The Cupertino Tennis Club in addition to USTA League teams, sponsor the the following activities: </p>\r\n              <ul class=\"front-page-list\">\r\n                <li> Women\'s Interclub. </li>\r\n                <li> Men drop in every Mon/Wed/Fri at 12:00 pm. </li>\r\n                <li> Socials. </li>\r\n                <li> Drop in tennis is every Friday night at 6:45 pm conducted by the Cupertino Sports Center.</li>\r\n              </ul>  \r\n              \r\n              <p> <strong>  WOMEN\'S INTERCLUB </strong> <p>\r\n              <p> Women\'s Interclub is played in the mornings, September through May with most of December off, and consists of between four and five doubles matches with other clubs in the area. Playing level is usually between 3.0 and 4.0. There is no fee to play and this is NOT a USTA sanctioned event.<p>\r\n              <p> For those of you who have never played Interclub, Interclub is a social/casual league where members from the Cupertino Sports Center play with other clubs in the area. After playing, the group will enjoy lunch with the opponents. If you are interested in playing, please contact the team captain directly or click to <a href=\"mailto:womensinterclub@cupertinotennisclub.org\">send email</a>. </p>  \r\n              <p> The club now has three levels of women\'s interclub: 3.0, 3.5 and 4.0. Please contact one of the women\'s interclub coordinator\'s for a current schedule of dates. <p>\r\n                <div class=\"table-responsive\">\r\n                  <table class=\"table table-hover table-bordered\">\r\n                      <thead>\r\n                          <tr class=\"success\">\r\n                               <th>Level</th>\r\n                               <th>Contact/Email</th>\r\n                          </tr>  \r\n                      </thead> \r\n                      <tbody>\r\n                          <tr>\r\n                               <th>3.0 level</th>\r\n                               <th><a href=\"mailto:womensinterclub30@cupertinotennisclub.org\"> Suzanne Lagace </a></th>\r\n                          </tr>\r\n                           <tr>\r\n                               <th>3.5 level</th>\r\n                               <th><a href=\"mailto:womensinterclub35@cupertinotennisclub.org\"> Emi Kawamoto </a></th>\r\n                          </tr>\r\n                           <tr>\r\n                               <th>4.0 level</th>\r\n                               <th><a href=\"mailto:womensinterclub40@cupertinotennisclub.org\"> Joan Hu, Yoko Kurosawa </a></th>\r\n                          </tr>\r\n\r\n                      </tbody> \r\n                  </table>\r\n                </div>\r\n              <p> <strong> SOCIALS </strong> <p>\r\n              <p> Socials are scheduled throughout the year depending on court availability and interest. Your ideas and suggestions are always welcome, please contact Lili Occena at <a href=\"mailto:Socials@CupertinoTennisClub.org\">Socials</a>.</p>\r\n              <p> The Annual meeting is scheduled for early December each year. It is usually held off-site with pizza, drinks and dessert followed by--or prior to--the annual meeting and election of new board members. </p>\r\n              <p> More information prior to each event will be published in the Newsletter and on our Home Page. </p>\r\n              <p> Want to run, or help with, a social? Have questions? Contact the <a href=\"mailto:Socials@Cupertinotennisclub.org\">Socials Director</a>. </p>\r\n\r\n        </div>','Club Activities','','inherit','closed','closed','','45-revision-v1','','','2015-11-26 11:36:59','2015-11-26 18:36:59','',45,'http://ctc.cupertinotennisclub.org/45-revision-v1/',0,'revision','',0),(489,25,'2015-12-01 22:18:25','2015-12-02 05:18:25','<div class=\"col-md-12\">\r\n<h1> 2015 record of declare intent to play USTA </h1>\r\n\r\n1.<a href=\"https://docs.google.com/spreadsheets/d/1JBSUZI9otEYIT-wxwDivBRrMWOSMkP4hTACdlNvGtt4/edit?usp=sharing\" target=\"_blank\"> Adult 40 & Mixed 40, 2015 </a>\r\n\r\n2.<a href=\"https://docs.google.com/spreadsheets/d/1SX2C6PD8WGzv2roEpqTkGSs4LmT-RxCnV7sfoSWT0Kc/edit?usp=sharing\" target=\"_blank\"> Adult 65, 2014-15 </a>\r\n\r\n3.<a href=\"https://docs.google.com/spreadsheets/d/1UV2i52I3hJ_ykFqzAducfl0UiiJ-kQK9SGghJET0WHY/edit?usp=sharing\" target=\"_blank\"> Adult 18, 2015 </a>\r\n\r\n4.<a href=\"https://docs.google.com/spreadsheets/d/11GxMk9SAv4NJHMwDT-sYqDRmAyYzHyMqev5D4T-ocyE/edit?usp=sharing\" targer=\"_blank\"> Mixed 18 & Adult 55, 2015 </a>\r\n\r\n5.<a href=\"https://docs.google