ase use the green buttons (below) to declare your intent to play in your intended league(s).\r\n\r\nYou may declare your intent to play on either <strong>one</strong> or <strong>two</strong> teams per league.\r\n\r\nThere are three team types at CTC:\r\n<ul class=\"front-page-list\">\r\n	<li><strong>Competitive</strong> - This team strives to win the league, and will predominantly play only the best players.</li>\r\n	<li><strong>Recreational</strong> - This team is composed of players who are not at the top of their level, but still enjoy good competition.\r\nThis team might also be composed of a group of friends who just enjoy playing with each other.</li>\r\n	<li><strong>Developmental</strong> - This team is composed mostly of players who are \"playing up\" at a level above their rating.</li>\r\n</ul>\r\n<strong> You have to be a registered member on this website in order to Declare Intent to play USTA. </strong>\r\n\r\n(These buttons will turn green while the Declaration period is open.)\r\n<div class=\"intent\">\r\n<div class=\"col-md-4\">\r\n<p class=\"btn btn-warning ustadeclare\" data-container=\"body\" data-toggle=\"popover\" data-placement=\"top\" data-content=\"Button will be available when declaration opens\">Adult 40 &amp; Mixed 40</p>\r\n\r\n</div>\r\n<div class=\"col-md-4\">\r\n<p class=\"btn btn-warning ustadeclare\" data-container=\"body\" data-toggle=\"popover\" data-placement=\"top\" data-content=\"Button will be available when declaration opens\">Adult 65</p>\r\n\r\n</div>\r\n<div class=\"col-md-4\">\r\n<p class=\"btn btn-warning ustadeclare\" data-container=\"body\" data-toggle=\"popover\" data-placement=\"top\" data-content=\"Button will be available when declaration opens\">Adult 18+ league</p>\r\n\r\n</div>\r\n<div class=\"col-md-4\">\r\n<p class=\"btn btn-warning ustadeclare\" data-container=\"body\" data-toggle=\"popover\" data-placement=\"top\" data-content=\"Button will be available when declaration opens\">Mixed 18 &amp; Adult 55</p>\r\n\r\n</div>\r\n<div class=\"col-md-4\">\r\n<p class=\"btn btn-warning ustadeclare\" data-container=\"body\" data-toggle=\"popover\" data-placement=\"top\" data-content=\"Button will be available when declaration opens\">Adult 70</p>\r\n\r\n</div>\r\n<div class=\"col-md-4\">\r\n<p class=\"btn btn-warning ustadeclare\" data-container=\"body\" data-toggle=\"popover\" data-placement=\"top\" data-content=\"Button will be available when declaration opens\">Mixed 55 &amp; Combo</p>\r\n\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-12\">\r\n<h4>Check below to see your name, and everyone else who has signed up.</h4>\r\n</div>\r\n<div class=\"col-md-6\">\r\n\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad40mix40/\">1. Adult 40 &amp; Mixed 40</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad65/\">2. Adult 65</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad18/\">3. Adult 18+ league</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalmix18ad55/\">4. Mixed 18 &amp; Adult 55</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad70/\">5. Adult 70</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalmix55combo/\">6. Mixed 55 &amp; Combo</a>\r\n\r\n</div>\r\n<div class=\"col-md-6\"><a href=\"https://docs.google.com/spreadsheets/d/1JBSUZI9otEYIT-wxwDivBRrMWOSMkP4hTACdlNvGtt4/edit?usp=sharing\" target=\"_blank\">1. 2015, Adult 40 &amp; Mixed 40</a>\r\n<a href=\"https://docs.google.com/spreadsheets/d/1SX2C6PD8WGzv2roEpqTkGSs4LmT-RxCnV7sfoSWT0Kc/edit?usp=sharing\" target=\"_blank\">2. 2015, Adult 65</a>\r\n<a href=\"https://docs.google.com/spreadsheets/d/1UV2i52I3hJ_ykFqzAducfl0UiiJ-kQK9SGghJET0WHY/edit?usp=sharing\" target=\"_blank\">3. 2015, Adult 18+ league</a>\r\n<a href=\"https://docs.google.com/spreadsheets/d/11GxMk9SAv4NJHMwDT-sYqDRmAyYzHyMqev5D4T-ocyE/edit?usp=sharing\" target=\"_blank\">4. 2015, Mixed 18 &amp; Adult 55</a>\r\n<a href=\"https://docs.google.com/spreadsheets/d/12LFNI47NXifGlYovo_90NVhmJ0ToP-ywS5i1sjb5eGI/edit?usp=sharing\" target=\"_blank\">5. 2015, Adult 70</a>\r\n<a href=\"https://docs.google.com/spreadsheets/d/1Go8Xnr9ANIX-sKGatMdvq5XmJRMd02ozsXl7EscHznI/edit?usp=sharing\" target=\"_blank\">6. 2015, Mixed 55 &amp; Combo</a></div>\r\n<div class=\"col-md-12\">\r\n\r\nIf you have questions about the teams or the league, or if you later find that you need to drop one (or both) teams, please send an email to the CTC <a href=\"mailto:USTA@cupertinotennisclub.org\">USTA coordinator.</a>\r\n\r\n</div>','declaretoplay','','inherit','closed','closed','','337-revision-v1','','','2015-12-03 23:57:11','2015-12-04 06:57:11','',337,'http://ctc.cupertinotennisclub.org/337-revision-v1/',0,'revision','',0),(545,26,'2015-12-08 14:59:35','2015-12-08 21:59:35','<div class=\"col-xs-12 col-md-8\">\n<h1>USTA League</h1>\n<ul class=\"front-page-list\">\n	<li>What is USTA League Tennis?</li>\n	<li>How do I join a CTC USTA League Team?</li>\n</ul>\n</div>\n<div class=\"col-xs-12 col-md-4\">\n<ul class=\"ustalist\">\n	<li><a href=\"http://ctc.cupertinotennisclub.org/declaretoplay/\"> DECLARE INTENT TO PLAY</a></li>\n	<li><a href=\"http://www.ustanorcal.com/organization.asp?id=113\" target=\"_blank\"> SEE ALL CTC TEAMS</a></li>\n	<li><a href=\"http://www.ustanorcal.com/ntrpsearch.asp?o=113#goto\" target=\"_blank\">CTC PLAYER\'S RATINGS</a></li>\n	<li><a href=\"http://www.usta.com/Adult-Tennis/USTA-League/ntrp/\" target=\"_blank\"> USTA RATINGS</a></li>\n	<li><a href=\"http://www.norcal.usta.com/adults/leagues/resources/\" target=\"_blank\">USTA GUIDE</a></li>\n</ul>\n</div>\n<div class=\"col-xs-12 col-md-12\">\n<h4 class=\"question\"><strong> What is USTA League Tennis?</strong></h4>\n<img class=\"pull-left ustaimg\" src=\"http://ctc.cupertinotennisclub.org/wp-content/uploads/2015/08/USTA_League-300x195.jpg\" alt=\"USTA League\" />\n\nThe USTA League Tennis is the country\'s largest recreational tennis league, providing organized, structured team matches for more than 300,000 men and women of all ability levels. In Northern California, tennis is an integral part of life in Northern California, and teams can be found on courts in the Bay Area and Sacramento, Santa Clara to Marin to Mendocino Counties, as far north as Redding and as far south as Fresno. Teams are set up according to NTRP rating, so you\'re always sure that you\'ll be facing off against someone of comparable ability. That keeps the competition lively and the atmosphere social. Read more at <a href=\"http://www.norcal.usta.com/\" target=\"_blank\"> USTA NorCal</a> website.\n<h4 class=\"question\"><strong> How do I join a CTC USTA League Tennis team?</strong></h4>\n<ul class=\"front-page-list\">\n	<li>Decide the level you wish to play (i.e. 2.5, 3.0 etc.). Your current USTA rating will help you decide. Determine your rating, if you do not have one, by using the USTA NorCal NTRP Self Rating Guidelines.</li>\n	<li>Check out the <a href=\"http://ctc.cupertinotennisclub.org/?p=33\">CTC Calendar </a> to learn about which teams are currently registering.</li>\n	<li>Contact the captain of the<a href=\"http://www.ustanorcal.com/organization.asp?id=113\" target=\"_blank\"> Cupertino team</a> you wish to play on and find out if the team needs players.</li>\n	<li>At the start of every season, teams have to be formed within a deadline. <a href=\"http://ctc.cupertinotennisclub.org/declaretoplay/\"> Declare your interest/intent to play </a> at the start of each league season.</li>\n	<li>Please note you have to be an annual Cupertino Sports Center member, an annual USTA member and Cupertino Tennis Club Member to play tennis on a Club-sponsored USTA team at the Sports Center.</li>\n	<li>If you still have a question please email <a href=\"mailto:womensusta@cupertinotennisclub.org\">womensusta@cupertinotennisclub.org</a> or <a href=\"mailto:mensusta@cupertinotennisclub.org\">mensusta@cupertinotennisclub.org</a>.</li>\n</ul>\nTo learn more about the club or get more involved by being a member, <a href=\"http://ctc.cupertinotennisclub.org/contact/\">contact us </a>.\n\n</div>','usta league','','inherit','closed','closed','','47-autosave-v1','','','2015-12-08 14:59:35','2015-12-08 21:59:35','',47,'http://ctc.cupertinotennisclub.org/47-autosave-v1/',0,'revision','',0),(546,26,'2015-12-04 15:34:08','2015-12-04 22:34:08','<div class=\"col-xs-12 col-md-8\">\r\n<h1>USTA League</h1>\r\n<ul class=\"front-page-list\">\r\n	<li>What is USTA League Tennis?</li>\r\n	<li>How do I join a CTC USTA League Team?</li>\r\n</ul>\r\n</div>\r\n<div class=\"col-xs-12 col-md-4\">\r\n<ul class=\"ustalist\">\r\n	<li><a href=\"http://ctc.cupertinotennisclub.org/declaretoplay/\"> DECLARE INTENT TO PLAY</a></li>\r\n	<li><a href=\"http://www.ustanorcal.com/organization.asp?id=113\" target=\"_blank\"> SEE ALL CTC TEAMS</a></li>\r\n	<li><a href=\"http://www.usta.com/Adult-Tennis/USTA-League/ntrp/\" target=\"_blank\"> USTA RATINGS</a></li>\r\n	<li><a href=\"http://www.norcal.usta.com/adults/leagues/resources/\" target=\"_blank\">USTA GUIDE</a></li>\r\n</ul>\r\n</div>\r\n<div class=\"col-xs-12 col-md-12\">\r\n<h4 class=\"question\"><strong> What is USTA League Tennis?</strong></h4>\r\n<img class=\"pull-left ustaimg\" src=\"http://ctc.cupertinotennisclub.org/wp-content/uploads/2015/08/USTA_League-300x195.jpg\" alt=\"USTA League\" />\r\n\r\nThe USTA League Tennis is the country\'s largest recreational tennis league, providing organized, structured team matches for more than 300,000 men and women of all ability levels. In Northern California, tennis is an integral part of life in Northern California, and teams can be found on courts in the Bay Area and Sacramento, Santa Clara to Marin to Mendocino Counties, as far north as Redding and as far south as Fresno. Teams are set up according to NTRP rating, so you\'re always sure that you\'ll be facing off against someone of comparable ability. That keeps the competition lively and the atmosphere social. Read more at <a href=\"http://www.norcal.usta.com/\" target=\"_blank\"> USTA NorCal</a> website.\r\n<h4 class=\"question\"><strong> How do I join a CTC USTA League Tennis team?</strong></h4>\r\n<ul class=\"front-page-list\">\r\n	<li>Decide the level you wish to play (i.e. 2.5, 3.0 etc.). Your current USTA rating will help you decide. Determine your rating, if you do not have one, by using the USTA NorCal NTRP Self Rating Guidelines.</li>\r\n	<li>Check out the <a href=\"http://ctc.cupertinotennisclub.org/?p=33\">CTC Calendar </a> to learn about which teams are currently registering.</li>\r\n	<li>Contact the captain of the<a href=\"http://www.ustanorcal.com/organization.asp?id=113\" target=\"_blank\"> Cupertino team</a> you wish to play on and find out if the team needs players.</li>\r\n	<li>At the start of every season, teams have to be formed within a deadline. <a href=\"http://ctc.cupertinotennisclub.org/declaretoplay/\"> Declare your interest/intent to play </a> at the start of each league season.</li>\r\n	<li>Please note you have to be an annual Cupertino Sports Center member, an annual USTA member and Cupertino Tennis Club Member to play tennis on a Club-sponsored USTA team at the Sports Center.</li>\r\n	<li>If you still have a question please email <a href=\"mailto:womensusta@cupertinotennisclub.org\">womensusta@cupertinotennisclub.org</a> or <a href=\"mailto:mensusta@cupertinotennisclub.org\">mensusta@cupertinotennisclub.org</a>.</li>\r\n</ul>\r\nTo learn more about the club or get more involved by being a member, <a href=\"http://ctc.cupertinotennisclub.org/contact/\">contact us </a>.\r\n\r\n</div>','usta league','','inherit','closed','closed','','47-revision-v1','','','2015-12-04 15:34:08','2015-12-04 22:34:08','',47,'http://ctc.cupertinotennisclub.org/47-revision-v1/',0,'revision','',0),(547,26,'2016-08-18 09:16:30','2016-08-18 16:16:30','<div class=\"col-xs-12 col-md-12\">\r\n<h1>CTC Board</h1>\r\nCupertino Tennis club board meetings are held from January through November at the Cupertino Sports Center. Check the <a href=\"http: