ly the best players.</li>\r\n	<li><strong>Recreational</strong> - This team is composed of players who are not at the top of their level, but still enjoy good competition.\r\nThis team might also be composed of a group of friends who just enjoy playing with each other.</li>\r\n	<li><strong>Developmental</strong> - This team is composed mostly of players who are \"playing up\" at a level above their rating.</li>\r\n</ul>\r\n<strong> You have to be a registered member on this website in order to Declare Intent to play USTA. </strong>\r\n\r\n(These buttons will turn green while the Declaration period is open.)\r\n<div class=\"intent\">\r\n\r\n<div class=\"col-md-4\">\r\n<p class=\"btn btn-warning ustadeclare\" data-container=\"body\" data-toggle=\"popover\" data-placement=\"top\" data-content=\"Button will be available when declaration opens\">Adult 40 &amp; Mixed 40</p>\r\n</div>\r\n<!--\r\n<div class=\"col-md-4\">\r\n<a class=\"btn btn-success withtopadj\" href=\"http://ctc.cupertinotennisclub.org/adult40mixed40/\">Adult 40 &amp; Mixed 40</a></div>\r\n-->\r\n\r\n\r\n<div class=\"col-md-4\">\r\n<p class=\"btn btn-warning ustadeclare\" data-container=\"body\" data-toggle=\"popover\" data-placement=\"top\" data-content=\"Button will be available when declaration opens\">Adult 65</p>\r\n</div>\r\n<!--\r\n<div class=\"col-md-4\">\r\n<a class=\"btn btn-success withtopadj\" href=\"http://ctc.cupertinotennisclub.org/adult65/\">Adult 65</a></div>\r\n-->\r\n\r\n\r\n<div class=\"col-md-4\">\r\n<p class=\"btn btn-warning ustadeclare\" data-container=\"body\" data-toggle=\"popover\" data-placement=\"top\" data-content=\"Button will be available when declaration opens\">Adult 18+ league</p>\r\n</div>\r\n<!--\r\n<div class=\"col-md-4\">\r\n<a class=\"btn btn-success withtopadj\" href=\"http://ctc.cupertinotennisclub.org/adult18/\">Adult 18+</a></div>\r\n-->\r\n\r\n\r\n<div class=\"col-md-4\">\r\n<p class=\"btn btn-warning ustadeclare\" data-container=\"body\" data-toggle=\"popover\