:53:46','','totalcombodaytime','','inherit','closed','closed','','633-revision-v1','','','2016-06-28 12:53:46','2016-06-28 19:53:46','',633,'http://ctc.cupertinotennisclub.org/633-revision-v1/',0,'revision','',0),(635,25,'2016-06-28 12:55:10','2016-06-28 19:55:10','[declaretoplaycombodaytime]','combodaytime','','publish','closed','closed','','combodaytime','','','2016-06-28 13:00:03','2016-06-28 20:00:03','',0,'http://ctc.cupertinotennisclub.org/?page_id=635',0,'page','',0),(636,25,'2016-06-28 12:55:10','2016-06-28 19:55:10','[declaretoplaycombodaytime]','combodaytime','','inherit','closed','closed','','635-revision-v1','','','2016-06-28 12:55:10','2016-06-28 19:55:10','',635,'http://ctc.cupertinotennisclub.org/635-revision-v1/',0,'revision','',0),(637,25,'2016-06-28 13:37:13','2016-06-28 20:37:13','<div class=\"col-md-12\">\r\n<h1>Interested in playing on a USTA league team?</h1>\r\nPlease use the green buttons (below) to declare your intent to play in your intended league(s).\r\n\r\nYou may declare your intent to play on either <strong>one</strong> or <strong>two</strong> teams per league.\r\n\r\nThere are three team types at CTC:\r\n<ul class=\"front-page-list\">\r\n	<li><strong>Competitive</strong> - This team strives to win the league, and will predominantly play only the best players.</li>\r\n	<li><strong>Recreational</strong> - This team is composed of players who are not at the top of their level, but still enjoy good competition.\r\nThis team might also be composed of a group of friends who just enjoy playing with each other.</li>\r\n	<li><strong>Developmental</strong> - This team is composed mostly of players who are \"playing up\" at a level above their rating.</li>\r\n</ul>\r\n<strong> You have to be a registered member on this website in order to Declare Intent to play USTA. </strong>\r\n\r\n[buttons]\r\n\r\n<div class=\"col-md-12\">\r\n<h4>Check below to see your name, and everyone else who has signed up.</h4>\r\n</div>\r\n<div class=\"col-md-6\">\r\n\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad40mix40/\">1. Adult 40 &amp; Mixed 40</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad65/\">2. Adult 65</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad18/\">3. Adult 18+ league</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalmix18ad55/\">4. Mixed 18 &amp; Adult 55</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad70/\">5. Adult 70</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalmix55combo/\">6. Mixed 55 &amp; Combo</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalcombodaytime/\">6. Combo Daytime</a>\r\n\r\n</div>\r\n\r\n<div class=\"col-md-12\">\r\n\r\nIf you have questions about the teams or the league, or if you later find that you need to drop one (or both) teams, please send an email to the CTC <a href=\"mailto:USTA@cupertinotennisclub.org\">USTA coordinator.</a>\r\n\r\n</div>','declaretoplay','','inherit','closed','closed','','337-revision-v1','','','2016-06-28 13:37:13','2016-06-28 20:37:13','',337,'http://ctc.cupertinotennisclub.org/337-revision-v1/',0,'revision','',0),(638,25,'2016-06-28 13:37:23','2016-06-28 20:37:23','<div class=\"col-md-12\">\r\n<h1>Interested in playing on a USTA league team?</h1>\r\nPlease use the green buttons (below) to declare your intent to play in your intended league(s).\r\n\r\nYou may declare your intent to play on either <strong>one</strong> or <strong>two</strong> teams per league.\r\n\r\nThere are three team types at CTC:\r\n<ul class=\"front-page-list\">\r\n	<li><strong>Competitive</strong> - This team strives to win the league, and will predominantly play only the best players.</li>\r\n	<li><strong>Recreational</strong> - This team is composed of players who are not at the top of their level, but still enjoy good competition.\r\nThis team might also be composed of a group of friends who just enjoy playing with each other.</li>\r\n	<li><strong>Developmental</strong> - This team is composed mostly of players who are \"playing up\" at a level above their rating.</li>\r\n</ul>\r\n<strong> You have to be a registered member on this website in order to Declare Intent to play USTA. </strong>\r\n\r\n[buttons]\r\n\r\n<div class=\"col-md-12\">\r\n<h4>Check below to see your name, and everyone else who has signed up.</h4>\r\n</div>\r\n<div class=\"col-md-6\">\r\n\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad40mix40/\">1. Adult 40 &amp; Mixed 40</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad65/\">2. Adult 65</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad18/\">3. Adult 18+ league</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalmix18ad55/\">4. Mixed 18 &amp; Adult 55</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad70/\">5. Adult 70</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalmix55combo/\">6. Mixed 55 &amp; Combo</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalcombodaytime/\">7. Combo Daytime</a>\r\n\r\n</div>\r\n\r\n<div class=\"col-md-12\">\r\n\r\nIf you have questions about the teams or the league, or if you later find that you need to drop one (or both) teams, please send an email to the CTC <a href=\"mailto:USTA@cupertinotennisclub.org\">USTA coordinator.</a>\r\n\r\n</div>','declaretoplay','','inherit','closed','closed','','337-revision-v1','','','2016-06-28 13:37:23','2016-06-28 20:37:23','',337,'http://ctc.cupertinotennisclub.org/337-revision-v1/',0,'revision','',0),(642,26,'2016-08-17 10:42:00','2016-08-17 17:42:00','<div class=\"col-xs-12 col-md-12\">\n            <h1>CTC Activities</h1>\n              <p> The Cupertino Tennis Club in addition to USTA League teams, sponsor the the following activities: </p>\n              <ul class=\"front-page-list\">\n                <li> Women\'s Interclub. </li>\n                <li> Men drop in every Mon/Wed/Fri at 12:00 pm. </li>\n                <li> Socials. </li>\n                <li> Drop in tennis is every Friday night at 6:45 pm conducted by the Cupertino Sports Center.</li>\n              </ul>  \n              \n              <p> <strong>  WOMEN\'S INTERCLUB </strong> <p>\n              <p> For those of you who have never played Women\'s Interclub, Interclub is a social/casual league where members from the Cupertino Tennis Club play with other clubs in the area. After playing, the group will enjoy lunch with the opponents. </p>  \n              <p> Interclub matches are played in the mornings, September through May with most of December off, and usually consist of four or five doubles matches. The playing level is usually between 3.0 and 4.0. There is no fee to play, and this is NOT a USTA sanctioned event.<p>\n              <p> The club now has three levels of women\'s interclub: 3.0, 3.5 and 4.0. &nbsp; If you are interested in playing, please contact the team captain(s) either directly or by clicking on their names for a current schedule of dates. </p>\n                <div class=\"table-responsive\">\n                  <table class=\"table table-hover table-bordered\">\n                      <thead>\n                          <tr class=\"success\">\n                               <th>Level</th>\n                               <th>Contact/Email</th>\n                          </tr>  \n                      </thead> \n                      <tbody>\n                          <tr>\n                               <th>3.0-3.5 level</th>\n                               <th><a href=\"mailto:womensinterclub30@cupertinotennisclub.org\"> Adela Springer & Elaine Reiling </a></th>\n                          </tr>\n                           <tr>\n                               <th>3.5 level</th>\n                               <th><a href=\"mailto:womensinterclub35@cupertinotennisclub.org\"> Pat Frischmann </a></th>\n                          </tr>\n                           <tr>\n                               <th>4.0 level</th>\n                               <th><a href=\"mailto:womensinterclub40@cupertinotennisclub.org\"> Joan Hu, Yoko Kurosawa </a></th>\n                          </tr>\n\n                      </tbody> \n                  </table>\n                </div>\n              <p> <strong> SOCIALS </strong> <p>\n              <p> Socials are scheduled throughout the year depending on court availability and interest. Your ideas and suggestions are always welcome, please contact Lili Occena at <a href=\"mailto:Socials@CupertinoTennisClub.org\">Socials</a>.</p>\n              <p> The Annual meeting is scheduled for early December each year. It is usually held off-site with pizza, drinks and dessert followed by--or prior to--the annual meeting and election of new board members. </p>\n              <p> More information prior to each event will be published in the Newsletter and on our Home Page. </p>\n              <p> Want to run, or help with, a social? Have questions? Contact the <a href=\"mailto:Socials@Cupertinotennisclub.org\">Socials Director</a>. </p>\n\n        </div>','Club Activities','','inherit','closed','closed','','45-autosave-v1','','','2016-08-17 10:42:00','2016-08-17 17:42:00','',45,'http://ctc.cupertinotennisclub.org/45-autosave-v1/',0,'revision','',0),(643,26,'2016-08-16 15:03:07','2016-08-16 22:03:07','<div class=\"col-xs-12 col-md-12\">\r\n            <h1>CTC Activities</h1>\r\n              <p> The Cupertino Tennis Club in addition to USTA League teams, sponsor the the following activities: </p>\r\n              <ul class=\"front-page-list\">\r\n                <li> Women\'s Interclub. </li>\r\n                <li> Men drop in every Mon/Wed/Fri at 12:00 pm. </li>\r\n                <li> Socials. </li>\r\n                <li> Drop in tennis is every Friday night at 6:45 pm conducted by the Cupertino Sports Center.</li>\r\n              </ul>  \r\n              \r\n              <p> <strong>  WOMEN\'S INTERCLUB </strong> <p>\r\n              <p> Women\'s Interclub is played in the mornings, September through May with most of December off, and consists of be