/ctc.cupertinotennisclub.org/wp-content/uploads/2015/08/CTC-Board-minutesAugust15.pdf\">CTC Board Minutes August 2015</a></li>\r\n   <li><a href=\"http://ctc.cupertinotennisclub.org/wp-content/uploads/2015/11/CTC-Board-minutessSeptember15.pdf\">CTC Board Minutes September 2015</a></li>\r\n   <li><a href=\"http://ctc.cupertinotennisclub.org/wp-content/uploads/2015/11/CTC-Board-minutesOctober15.pdf\">CTC Board Minutes October 2015</a></li>\r\n   <li><a href=\"http://ctc.cupertinotennisclub.org/wp-content/uploads/2015/11/CTCBoardminutesNovember15.pdf\">CTC Board Minutes November 2015</a>  </li>\r\n  <li><a href=\"http://ctc.cupertinotennisclub.org/wp-content/uploads/2015/12/CTCBoardminutesDecember15-3.pdf\">CTC Board Minutes December 2015</a>  </li>\r\n  <li><a href=\"http://ctc.cupertinotennisclub.org/wp-content/uploads/2016/06/CTCBoardMeetingJanuary2016.pdf\">CTC Board Minutes January 2016</a>  </li>\r\n  <li><a href=\"http://ctc.cupertinotennisclub.org/wp-content/uploads/2016/06/CTCBoardMeetingFebruary2016.pdf\">CTC Board Minutes February 2016</a>  </li>\r\n  <li><a href=\"http://ctc.cupertinotennisclub.org/wp-content/uploads/2016/06/CTCBoardMeetingMarch2016.pdf\">CTC Board Minutes March 2016</a> \r\n </li>\r\n  <li><a href=\"http://ctc.cupertinotennisclub.org/wp-content/uploads/2016/06/DrafCTCBoardMeetingMay2016.pdf\">CTC Board Minutes May 2016</a> \r\n </li>\r\n  <li><a href=\"http://ctc.cupertinotennisclub.org/wp-content/uploads/2016/06/DrafCTCBoardMeetingJune2016.pdf\">CTC Board Minutes June 2016</a> \r\n </li>\r\n <li><a href=\"http://ctc.cupertinotennisclub.org/wp-content/uploads/2016/09/MinutesCaptainsmeeting.pdf\">Captains Meeting Report Sep 2016</a> \r\n </li>\r\n\r\n\r\n</ul>\r\n   \r\n\r\n</div>','minutes','','inherit','closed','closed','','31-revision-v1','','','2016-09-21 07:45:35','2016-09-21 14:45:35','',31,'http://ctc.cupertinotennisclub.org/31-revision-v1/',0,'revision','',0),(653,25,'2016-11-04 17:23:38','2016-11-05 00:23:38','<div class=\"col-md-12\">\r\n<h1>Interested in playing on a USTA league team?</h1>\r\nPlease use the green buttons (below) to declare your intent to play in your intended league(s).\r\n\r\nYou may declare your intent to play on either <strong>one</strong> or <strong>two</strong> teams per league.\r\n\r\nThere are three team types at CTC:\r\n<ul class=\"front-page-list\">\r\n	<li><strong>Competitive</strong> - This team strives to win the league, and will predominantly play only the best players.</li>\r\n	<li><strong>Recreational</strong> - This team is composed of players who are not at the top of their level, but still enjoy good competition.\r\nThis team might also be composed of a group of friends who just enjoy playing with each other.</li>\r\n	<li><strong>Developmental</strong> - This team is composed mostly of players who are \"playing up\" at a level above their rating.</li>\r\n</ul>\r\n<strong> You have to be a registered member on this website in order to Declare Intent to play USTA. </strong>\r\n\r\n[buttons]\r\n\r\n<div class=\"col-md-12\">\r\n<h4>Check below to see your name, and everyone else who has signed up.</h4>\r\n</div>\r\n<div class=\"col-md-6\">\r\n\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad40mix40/\">1. Adult 40 &amp; Mixed 40</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad65/\">2. Adult 65</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad18/\">3. Adult 18+ league</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalmix18ad55/\">4. Mixed 18 &amp; Adult 55</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad70/\">5. Adult 70</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalmix55combo/\">6. Mixed 55 &amp; Combo</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalcombodaytime/\">7. Women Daytime Combo</a>\r\n\r\n</div>\r\n\r\n<div class=\"col-md-12\">\r\n\r\nIf you have questions about the teams or the league, or if you later find that you need to drop one (or both) teams, please send an email to the CTC <a href=\"mailto:USTA@cupertinotennisclub.org\">USTA coordinator.</a>\r\n\r\n</div>','declaretoplay','','inherit','closed','closed','','337-revision-v1','','','2016-11-04 17:23:38','2016-11-05 00:23:38','',337,'http://ctc.cupertinotennisclub.org/337-revision-v1/',0,'revision','',0),(654,25,'2016-11-04 22:39:23','2016-11-05 05:39:23','','total40womendaytime','','publish','closed','closed','','total40womendaytime','','','2016-11-04 22:39:23','2016-11-05 05:39:23','',0,'http://ctc.cupertinotennisclub.org/?page_id=654',0,'page','',0),(655,25,'2016-11-04 22:39:23','2016-11-05 05:39:23','','total40womendaytime','','inherit','closed','closed','','654-revision-v1','','','2016-11-04 22:39:23','2016-11-05 05:39:23','',654,'http://ctc.cupertinotennisclub.org/654-revision-v1/',0,'revision','',0),(656,25,'2016-11-04 22:41:21','2016-11-05 05:41:21','[declaretoplay40womendaytime]','40womensdaytime','','publish','closed','closed','','40womensdaytime','','','2016-11-04 22:51:12','2016-11-05 05:51:12','',0,'http://ctc.cupertinotennisclub.org/?page_id=656',0,'page','',0),(657,25,'2016-11-04 22:41:21','2016-11-05 05:41:21','[declaretoplay40womendaytime]','40womendaytime','','inherit','closed','closed','','656-revision-v1','','','2016-11-04 22:41:21','2016-11-05 05:41:21','',656,'http://ctc.cupertinotennisclub.org/656-revision-v1/',0,'revision','',0),(658,25,'2016-11-04 22:48:50','2016-11-05 05:48:50','[declaretoplay40womendaytime]','40womensdaytime','','inherit','closed','closed','','656-revision-v1','','','2016-11-04 22:48:50','2016-11-05 05:48:50','',656,'http://ctc.cupertinotennisclub.org/656-revision-v1/',0,'revision','',0),(659,25,'2016-11-04 22:55:14','2016-11-05 05:55:14','<div class=\"col-md-12\">\r\n<h1>Interested in playing on a USTA league team?</h1>\r\nPlease use the green buttons (below) to declare your intent to play in your intended league(s).\r\n\r\nYou may declare your intent to play on either <strong>one</strong> or <strong>two</strong> teams per league.\r\n\r\nThere are t