:31:39','2017-03-13 04:31:39','','waivertotal','','inherit','closed','closed','','689-revision-v1','','','2017-03-12 21:31:39','2017-03-13 04:31:39','',689,'http://ctc.cupertinotennisclub.org/689-revision-v1/',0,'revision','',0),(693,25,'2017-03-16 15:14:04','2017-03-16 22:14:04','','paidandwaivers','','publish','closed','closed','','paidandwaivers','','','2019-12-14 05:21:25','2019-12-14 13:21:25','',0,'http://ctc.cupertinotennisclub.org/?page_id=693',0,'page','',0),(694,25,'2017-03-16 15:14:04','2017-03-16 22:14:04','','paidandwaivers2017','','inherit','closed','closed','','693-revision-v1','','','2017-03-16 15:14:04','2017-03-16 22:14:04','',693,'http://ctc.cupertinotennisclub.org/693-revision-v1/',0,'revision','',0),(698,25,'2017-04-14 11:52:44','2017-04-14 18:52:44','<div class=\"col-md-8\">\r\n<h1>Welcome to the Cupertino Tennis Club!</h1>\r\n<p>The Cupertino Tennis Club (CTC) is co-sponsored by the City of Cupertino and is open to residents and non-residents. CTC coordinates USTA tennis teams (USTA NorCal Leagues), Interclub, and social events.</p>\r\n<p>The Cupertino Sports Center (CSC)  is the location for league play and other events.</p>\r\n<p><strong>Please note: </strong>You must have an ANNUAL (not monthly)  membership at CSC and be a current member of CTC prior to playing on a CTC USTA or Interclub team.</p>\r\n\r\n<p>Come on out to CSC and play some tennis!!! </p>\r\n\r\nHere are a few ways to get started with playing tennis and meeting people!\r\n<ul class=\"front-page-list\">\r\n	<li>DECLARE INTENT to play and join a Cupertino Tennis Team to play in a USTA League.</li>\r\n        <li>Participate in Womens Interclub.</li>\r\n	<li>Play mens drop-in tennis MWF at 1:00 PM.</li>\r\n        <li>Watch for CTC Socials (coming soon). </li>\r\n        <li>Play drop-in tennis Friday nights 6:45 PM.</li>\r\n	<li>Volunteer for one or more of the club\'s activities - a great way to meet new people and have a good time!</li>\r\n	\r\n</ul>\r\n<address><strong>Cupertino Sports Center</strong>\r\n21111 Stevens Creek Blvd, Cupertino, CA 95014\r\n<abbr title=\"Phone\">P:</abbr> (408) 777-3160</address>\r\n<div class=\"thumbnail\"><iframe style=\"border: 0;\" src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3172.799658505789!2d-122.04275199999998!3d37.323572999999996!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x808fb44dc125cec7%3A0x9e30b79f6e4ecc9c!2sCupertino+Sports+Center!5e0!3m2!1sen!2sus!4v1440454038035\" width=\"100%\" height=\"300\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>\r\n<div class=\"col-md-4\">\r\n<div class=\"thumbnail sidebarright\"><a href=\"https://ctc.cupertinotennisclub.org/declaretoplay/\">\r\n<img class=\"img-responsive thumbnail sidebarimage\" src=\"https://ctc.cupertinotennisclub.org/wp-content/uploads/2015/08/mainbaner.jpg\" alt=\"Declare to Play USTA\" />\r\nDeclare to play USTA</a></div>\r\n<div class=\"thumbnail sidebarright\"><a href=\"https://ctc.cupertinotennisclub.org/?p=35\">\r\n<img class=\"img-responsive thumbnail sidebarimage\" src=\"https://ctc.cupertinotennisclub.org/wp-content/uploads/2015/08/membership.jpg\" alt=\"Membership Application\" />\r\nMembership Application</a></div>\r\n<div class=\"thumbnail sidebarright\"><a href=\"https://ctc.cupertinotennisclub.org/?p=45\">\r\n<img class=\"img-responsive thumbnail sidebarimage\" src=\"https://ctc.cupertinotennisclub.org/wp-content/uploads/2015/08/interclub.jpg\" alt=\"Interclub\" />\r\nInterclub</a></div>\r\n</div>','home','','inherit','closed','closed','','14-revision-v1','','','2017-04-14 11:52:44','2017-04-14 18:52:44','',14,'https://ctc.cupertinotennisclub.org/14-revision-v1/',0,'revision','',0),(702,25,'2017-06-24 16:57:20','2017-06-24 23:57:20','<div class=\"col-md-12\">\r\n<h1>Interested in playing on a USTA league team?</h1>\r\nPlease use the green buttons (below) to declare your intent to play in your intended league(s).\r\n\r\nYou may declare your intent to play on either <strong>one</strong> or <strong>two</strong> teams per league.\r\n\r\nThere are three team types at CTC:\r\n<ul class=\"front-page-list\">\r\n	<li><strong>Competitive</strong> - This team strives to win the league, and will predominantly play only the best players.</li>\r\n	<li><strong>Recreational</strong> - This team is composed of players who are not at the top of their level, but still enjoy good competition.\r\nThis team might also be composed of a group of friends who just enjoy playing with each other.</li>\r\n	<li><strong>Developmental</strong> - This team is composed mostly of players who are \"playing up\" at a level above their rating.</li>\r\n</ul>\r\n<strong> You have to be a registered member on this website in order to Declare Intent to play USTA. </strong>\r\n\r\n[buttons]\r\n\r\n<div class=\"col-md-12\">\r\n<h4>Check below to see your name, and everyone else who has signed up.</h4>\r\n</div>\r\n<div class=\"col-md-6\">\r\n\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad40mix40/\">1. Adult 40 &amp; Mixed 55</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad65/\">2. Adult 65</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad18/\">3. Adult 18+ league</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalmix18ad55/\">4. Mixed 18 &amp; Adult 55</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad70/\">5. Adult 70</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalmix55combo/\">6. Mixed 40 &amp; Combo</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalcombodaytime/\">7. Women Daytime Combo</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/total40womendaytime/\">8. Women Daytime Adult 40 </a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/total18womendaytime/\">9. Women Daytime Adult 18 </a>\r\n\r\n\r\n\r\n</div>\r\n\r\n<div class=\"col-md-12\">\r\n\r\nIf you have questions about the teams or the league, or if you later find that you need to drop one (or both) teams, please send an email to the CTC <a href=\"mailto:USTA@cupertinotennisclub.org\">USTA coordinator.</a>\r\n\r\n</div>','declaretoplay','','inherit','closed','closed','','337-revision-v1','','','2017-06-24 16:57:20','2017-06-24 23:57:20','',337,'https://ctc.cupertinotennisclub.org/337-revision-v1/',0,'revision','',0),(703,25,'2017-06-24 16:58:23','2017-06-24 23:58:23','','totalad40Mix55','','inherit','closed','closed','','399-revision-v1','','','2017-06-24 16:58:23','2017-06-24 23:58:23','',399,'https://ctc.cupertinotennisclub.org/399-revision-v1/',0,'revision','',0),(704,25,'2017-06-24 16:59:04','2017-06-24 23:59:04','','totalmix40combo','','inherit','closed','closed','','413-revision-v1','','','2017-06-24 16:59:04','2017-06-24 23:59:04','',413,'https://ctc.cupertinotennisclub.org/413-revision-v1/',0,'revision','',0),(705,25,'2017-06-24 16:59:43','2017-06-24 23:59:43','<div class=\"col-md-12\">\r\n<h1>Interested in playing on a USTA league team?</h1>\r\nPlease use the green buttons (below) to declare your intent to play in your intended league(s).\r\n\r\nYou may declare your intent to play on either <strong>one</strong> or <strong>two</strong> teams per league.\r\n\r\nThere are three team types at CTC:\r\n<ul class=\"front-page-list\">\r\n	<li><strong>Competitive</strong> - This team strives to win the league, and will predominantly play only the best players.</li>\r\n	<li><strong>Recreational</strong> - This team is composed of players who are not at the top of their level, but still enjoy good competition.\r\nThis team might also be composed of a group of friends who just enjoy playing with each other.</li>\r\n	<li><strong>Developmental</strong> - This team is composed mostly of players who are \"playing up\" at a level above their rating.</li>\r\n</ul>\r\n<strong> You have to be a registered member on this website in order to Declare Intent to play USTA. </strong>\r\n\r\n[buttons]\r\n\r\n<div class=\"col-md-12\">\r\n<h4>Check below to see your name, and everyone else who has signed up.</h4>\r\n</div>\r\n<div class=\"col-md-6\">\r\n\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad40mix55/\">1. Adult 40 &amp; Mixed 55</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad65/\">2. Adult 65</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad18/\">3. Adult 18+ league</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalmix18ad55/\">4. Mixed 18 &amp; Adult 55</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad70/\">5. Adult 70</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalmix40combo/\">6. Mixed 40 &amp; Combo</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalcombodaytime/\">7. Women Daytime Combo</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/total40womendaytime/\">8. Women Daytime Adult 40 </a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/total18womendaytime/\">9. Women Daytime Adult 18 </a>\r\n\r\n\r\n\r\n</div>\r\n\r\n<div class=\"col-md-12\">\r\n\r\nIf you have questions about the teams or the league, or if you later find that you need to drop one (or both) teams, please send an email to the CTC <a href=\"mailto:USTA@cupertinotennisclub.org\">USTA coordinator.</a>\r\n\r\n</div>','declaretoplay','','inherit','closed','closed','','337-revision-v1','','','2017-06-24 16:59:43','2017-06-24 23:59:43','',337,'https://ctc.cupertinotennisclub.org/337-revision-v1/',0,'revision','',0),(706,25,'2017-06-24 17:02:51','2017-06-25 00:02:51','[declaretoplayadu40mix40]\r\n\r\n ','Adult40mixed55','','inherit','closed','closed','','378-revision-v1','','','2017-06-24 17:02:51','2017-06-25 00:02:51','',378,'https://ctc.cupertinotennisclub.org/378-revision-v1/',0,'revision','',0),(707,25,'2017-06-24 17:04:19','2017-06-25 00:04:19','[declaretoplaymix55combo]','mixed40combo','','inherit','closed','closed','','393-revision-v1','','','2017-06-24 17:04:19','2017-06-25 00:04:19','',393,'https://ctc.cupertinotennisclub.org/393-revision-v1/',0,'revision','',0),(710,25,'2017-09-14 17:09:15','2017-09-15 00:09:15','<div class=\"col-xs-12 col-md-12\">\r\n            <h1>CTC Activities</h1>\r\n              <p> The Cupertino Tennis Club in addition to USTA League teams, sponsor the the following activities: </p>\r\n              <ul class=\"front-page-list\">\r\n                <li> Women\'s Interclub. </li>\r\n                <li> Men drop in every Mon/Wed/Fri at 12:00 pm. </li>\r\n                <li> Socials. </li>\r\n                <li> Drop in tennis is every Friday night at 6:45 pm conducted by the Cupertino Sports Center.</li>\r\n              </ul>  \r\n              \r\n              <p> <strong>  WOMEN\'S INTERCLUB </strong> <p>\r\n              <p> For those of you who have never played Women\'s Interclub, Interclub is a social/casual league where members from the Cupertino Tennis Club play with other clubs in the area. After playing, the group will enjoy lunch with the opponents. </p>  \r\n              <p> Interclub matches are played in the mornings, September through May with most of December off, and usually consist of four or five doubles matches. The playing level is usually between 3.0 and 4.0. There is no fee to play, and this is NOT a USTA sanctioned event.<p>\r\n              <p> The club now has three levels of women\'s interclub: 3.0, 3.5 and 4.0. &nbsp; If you are interested in playing, please contact the team captain(s) either directly or by clicking on their names for a current schedule of dates. </p>\r\n                <div class=\"table-responsive\">\r\n                  <table class=\"table table-hover table-bordered\">\r\n                      <thead>\r\n                          <tr class=\"success\">\r\n                               <th>Level</th>\r\n                               <th>Contact/Email</th>\r\n                          </tr>  \r\n                      </thead> \r\n                      <tbody>\r\n                          <tr>\r\n                               <th>3.0-3.5 level</th>\r\n                               <th><a href=\"mailto:womensinterclub30@cupertinotennisclub.org\"> Adela Springer & Elaine Reiling </a></th>\r\n                          </tr>\r\n                           <tr>\r\n                               <th>3.5 level</th>\r\n                               <th><a href=\"mailto:womensinterclub35@cupertinotennisclub.org\"> Pat Frischmann </a></th>\r\n                          </tr>\r\n                           <tr>\r\n                               <th>4.0 level</th>\r\n                               <th><a href=\"mailto:womensinterclub40@cupertinotennisclub.org\"> Joan Hu, Lynne Stark </a></th>\r\n                          </tr>\r\n\r\n                      </tbody> \r\n                  </table>\r\n                </div>\r\n              <p> <strong> SOCIALS </strong> <p>\r\n              <p> Socials are scheduled throughout the year depending on court availability and interest. Your ideas and suggestions are always welcome, please contact Lili Occena at <a href=\"mailto:Socials@CupertinoTennisClub.org\">Socials</a>.</p>\r\n              <p> The Annual meeting is scheduled for early December each year. It is usually held off-site with pizza, drinks and dessert followed by--or prior to--the annual meeting and election of new board members. </p>\r\n              <p> More information prior to each event will be published in the Newsletter and on our Home Page. </p>\r\n              <p> Want to run, or help with, a social? Have questions? Contact the <a href=\"mailto:Socials@Cupertinotennisclub.org\">Socials Director</a>. </p>\r\n\r\n        </div>','Club Activities','','inherit','closed','closed','','45-revision-v1','','','2017-09-14 17:09:15','2017-09-15 00:09:15','',45,'https://ctc.cupertinotennisclub.org/45-revision-v1/',0,'revision','',0),(711,25,'2017-09-14 17:12:38','2017-09-15 00:12:38','<div class=\"col-xs-12 col-md-12\">\r\n<h1>CTC Board</h1>\r\nCupertino Tennis club board meetings are held from January through November at the Cupertino Sports Center. Check the <a href=\"http://ctc.cupertinotennisclub.org/index.php/about/calendar/\">Club Calendar</a> for the next board meeting. All CTC members are welcome to attend.\r\n<div class=\"table-responsive\">\r\n<table class=\"table table-hover table-bordered\">\r\n<thead>\r\n<tr class=\"success\">\r\n<th>Email</th>\r\n<th>Notes</th>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<th><a href=\"mailto:board@cupertinotennisclub.org\"> Board@CupertinoTennisClub.org </a></th>\r\n<th>To contact the CTC board of directors.</th>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div class=\"table-responsive\">\r\n<table class=\"table table-hover table-bordered\">\r\n<thead>\r\n<tr class=\"success\">\r\n<th>Office</th>\r\n<th>Email</th>\r\n<th>Person</th>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<th>President</th>\r\n<th><a href=\"mailto:president@cupertinotennisclub.org\"> President@CupertinoTennisClub.org </a></th>\r\n<th>Laura Worden</th>\r\n</tr>\r\n<tr>\r\n<th>Vice President</th>\r\n<th><a href=\"mailto:v-p@cupertinotennisclub.org\"> V-P@CupertinoTennisClub.org </a></th>\r\n<th>Dotti Rado</th>\r\n</tr>\r\n<tr>\r\n<th>Secretary</th>\r\n<th><a href=\"mailto:secretary@cupertinotennisclub.org\"> Secretary@CupertinoTennisClub.org </a></th>\r\n<th>Candace Danielson</th>\r\n</tr>\r\n<tr>\r\n<th>Treasurer</th>\r\n<th><a href=\"mailto:treasurer@cupertinotennisclub.org\"> Treasurer@CupertinoTennisClub.org </a></th>\r\n<th>Ellis Wilkens</th>\r\n</tr>\r\n<tr>\r\n<th>Membership</th>\r\n<th><a href=\"mailto:membership@cupertinotennisclub.org\"> Membership@CupertinoTennisClub.org </a></th>\r\n<th>John Sperinde</th>\r\n</tr>\r\n<tr>\r\n<th>Tournaments</th>\r\n<th><a href=\"mailto:tournaments@cupertinotennisclub.org\"> Tournaments@CupertinoTennisClub.org </a></th>\r\n<th>N-A</th>\r\n</tr>\r\n<tr>\r\n<th>Men\'s, Women\'s, Mixed USTA</th>\r\n<th><a href=\"mailto:usta@cupertinotennisclub.org\"> Usta@CupertinoTennisClub.org </a></th>\r\n<th>Tony Serksnis</th>\r\n</tr>\r\n<tr>\r\n<th>Socials</th>\r\n<th><a href=\"mailto:social@cupertinotennisclub.o