=\"mailto:community-liaison@cupertinotennisclub.org\"> Community-Liaison@CupertinoTennisClub.org </a></th>\r\n<th>Ed Hirshfield</th>\r\n</tr>\r\n<tr>\r\n<th>Cupertino Sports Center</th>\r\n<th><a href=\"mailto:csc-rep@cupertinotennisclub.org\"> CSC-REP@CupertinoTennisClub.org </a></th>\r\n<th>Colleen Ferris</th>\r\n</tr>\r\n</tbody>\r\n</table>\r\nContact any board member if you are interested in filling an open position, or if you have questions regarding a position for next year on the board.\r\n\r\n</div>\r\n</div>','board','','inherit','closed','closed','','17-revision-v1','','','2018-03-19 19:11:49','2018-03-20 02:11:49','',17,'https://ctc.cupertinotennisclub.org/17-revision-v1/',0,'revision','',0),(745,25,'2018-07-22 18:29:48','2018-07-23 01:29:48','','total18-39singles','','publish','closed','closed','','total18-39singles','','','2018-07-22 18:39:27','2018-07-23 01:39:27','',0,'https://ctc.cupertinotennisclub.org/?page_id=745',0,'page','',0),(746,25,'2018-07-22 18:29:48','2018-07-23 01:29:48','','total18-39singles','','inherit','closed','closed','','745-revision-v1','','','2018-07-22 18:29:48','2018-07-23 01:29:48','',745,'https://ctc.cupertinotennisclub.org/745-revision-v1/',0,'revision','',0),(747,25,'2018-07-22 18:49:00','2018-07-23 01:49:00','[declaretoplay18_39singles]','adult18-39singles','','publish','closed','closed','','adult18-39singles','','','2018-07-22 18:49:00','2018-07-23 01:49:00','',0,'https://ctc.cupertinotennisclub.org/?page_id=747',0,'page','',0),(748,25,'2018-07-22 18:49:00','2018-07-23 01:49:00','[declaretoplay18_39singles]','adult18-39singles','','inherit','closed','closed','','747-revision-v1','','','2018-07-22 18:49:00','2018-07-23 01:49:00','',747,'https://ctc.cupertinotennisclub.org/747-revision-v1/',0,'revision','',0),(749,25,'2018-07-22 18:53:47','2018-07-23 01:53:47','<div class=\"col-md-12\">\r\n<h1>Interested in playing on a USTA league team?</h1>\r\nPlease use the green buttons (below) to declare your intent to play in your intended league(s).\r\n\r\nYou may declare your intent to play on either <strong>one</strong> or <strong>two</strong> teams per league.\r\n\r\nThere are three team types at CTC:\r\n<ul class=\"front-page-list\">\r\n	<li><strong>Competitive</strong> - This team strives to win the league, and will predominantly play only the best players.</li>\r\n	<li><strong>Recreational</strong> - This team is composed of players who are not at the top of their level, but still enjoy good competition.\r\nThis team might also be composed of a group of friends who just enjoy playing with each other.</li>\r\n	<li><strong>Developmental</strong> - This team is composed mostly of players who are \"playing up\" at a level above their rating.</li>\r\n</ul>\r\n<strong> You have to be a registered member on this website in order to Declare Intent to play USTA. </strong>\r\n\r\n[buttons]\r\n\r\n<div class=\"col-md-12\">\r\n<h4>Check below to see your name, and everyone else who has signed up.</h4>\r\n</div>\r\n<div class=\"col-md-6\">\r\n\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad40mix55/\">1. Adult 40 &amp; Mixed 55</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad65/\">2. Adult 65</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad18/\">3. Adult 18+ league</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalmix18ad55/\">4. Mixed 18 &amp; Adult 55</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalad70/\">5. Adult 70</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalmix40combo/\">6. Mixed 40 &amp; Combo</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/totalcombodaytime/\">7. Women Daytime Combo</a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/total40womendaytime/\">8. Daytime Adult 40 </a>\r\n<a href=\"http://ctc.cupertinotennisclub.org/total18womendaytime/\">9. Women Daytime Adult 18 </a>\r\n<a href=\"https://ctc.cupertinotennisclub.org/total18-39singles/\">10. Adult 18-39 Singles </a>\r\n\r\n\r\n\r\n</div>\r\n\r\n<div class=\"col-md-12\">\r\n\r\nIf you have questions about the teams or the league, or if you later find that you need to drop one (or both) teams, please send an email to the CTC <a href=\"mailto:USTA@cupertinotennisclub.org\">USTA coordinator.</a>\r\n\r\n</div>','declaretoplay','','inherit','closed','closed','','337-revision-v1','','','2018-07-22 18:53:47','2018-07-23 01:53:47','',337,'https://ctc.cupertinotennisclub.org/337-revision-v1/',0,'revision','',0),(751,25,'2018-08-06 14:48:56','2018-08-06 21:48:56','<div class=\"col-xs-12 col-md-12\">\r\n<h1>CTC Board</h1>\r\nCupertino Tennis club board meetings are held from January through November at the Cupertino Sports Center. Check the <a href=\"http://ctc.cupertinotennisclub.org/index.php/about/calendar/\">Club Calendar</a> for the next board meeting. All CTC members are welcome to attend.\r\n<div class=\"table-responsive\">\r\n<table class=\"table table-hover table-bordered\">\r\n<thead>\r\n<tr class=\"success\">\r\n<th>Email</th>\r\n<th>Notes</th>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<th><a href=\"mailto:board@cupertinotennisclub.org\"> Board@CupertinoTennisClub.org </a></th>\r\n<th>To contact the CTC board of directors.</th>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div class=\"table-responsive\">\r\n<table class=\"table table-hover table-bordered\">\r\n<thead>\r\n<tr class=\"success\">\r\n<th>Office</th>\r\n<th>Email</th>\r\n<th>Person</th>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<th>President</th>\r\n<th><a href=\"mailto:president@cupertinotennisclub.org\"> President@CupertinoTennisClub.org </a></th>\r\n<th>Dotti Rado</th>\r\n</tr>\r\n<tr>\r\n<th>Vice President</th>\r\n<th><a href=\"mailto:v-p@cupertinotennisclub.org\"> V-P@CupertinoTennisClub.org </a></th>\r\n<th>Laura Worden</th>\r\n</tr>\r\n<tr>\r\n<th>Secretary</th>\r\n<th><a href=\"mailto:secretary@cupertinotennisclub.org\"> Secretary@CupertinoTennisClub.org </a></th>\r\n<th>Candace Danielson</th>\r\n</tr>\r\n<tr>\r\n<th>Treasurer</th>\r\n<th><a href=\"mailto:treasurer@cupertinotennisclub.org\"> Treasurer@CupertinoTennisClub.org </a></th>\r\n<th>Ellis Wilkens</th>\r\n</tr>\r\n<tr>\r\n<th>Membership</th>\r\n<th><a href=\"mailto:membership@cupertinotennisclub.org\"> Membership@CupertinoTennisClub.org </a></th>\r\n<th>John Sperinde</th>\r\n</tr>\r\n<tr>\r\n<th>Tournaments</th>\r\n<th><a href=\"mailto:tournaments@cupertinotennisclub.org\"> Tournaments@CupertinoTennisClub.org </a></th>\r\n<th>N-A</th>\r\n</tr>\r\n<tr>\r\n<th>Men\'s, Women\'s, Mixed USTA</th>\r\n<th><a href=\"mailto:usta@cupertinotennisclub.org\"> Usta@CupertinoTennisClub.org </a></th>\r\n<th>Tony Serksnis</th>\r\n</tr>\r\n<tr>\r\n<th>Socials</th>\r\n<th><a href=\"mailto:social@cupertinotennisclub.org\"> Social@CupertinoTennisClub.org </a></th>\r\n<th>Analiza Dolor</th>\r\n</tr>\r\n<tr>\r\n<th>Women\'s Interclub</th>\r\n<th><a href=\"mailto:womensinterclub@cupertinotennisclub.org\"> WomensInterclub@CupertinoTennisClub.org </a></th>\r\n<th>Kweiping Wong, Captains: Joan Hu and Grace Haig</th>\r\n</tr>\r\n<tr>\r\n<th>Webmaster</th>\r\n<th><a href=\"mailto:webmaster@cupertinotennisclub.org\"> Webmaster@CupertinoTennisClub.org </a></th>\r\n<th>Oxana Gorbacheva and Mike Wilkens</th>\r\n</tr>\r\n<tr>\r\n<th>Community Liaison</th>\r\n<th><a href=\"mailto:community-liaison@cupertinotennisclub.org\"> Community-Liaison@CupertinoTennisClub.org </a></th>\r\n<th>Ed Hirshfield</th>\r\n</tr>\r\n<tr>\r\n<th>Cupertino Sports Center</th>\r\n<th><a href=\"mailto:csc-rep@cupertinotennisclub.org\"> CSC-REP@CupertinoTennisClub.org </a></th>\r\n<th>Colleen Ferris</th>\r\n</tr>\r\n</tbody>\r\n</table>\r\nContact any board member if you are interested in filling an open position, or if you have questions regarding a position for next year on the board.\r\n\r\n</div>\r\n</div>','board','','inherit','closed','closed','','17-revision-v1','','','2018-08-06 14:48:56','2018-08-06 21:48:56','',17,'https://ctc.cupertinotennisclub.org/17-revision-v1/',0,'revision','',0),(752,25,'2018-08-07 15:14:35','2018-08-07 22:14:35','<div class=\"col-xs-12 col-md-12\">\r\n            <h1>CTC Activities</h1>\r\n              <p> The Cupertino Tennis Club in addition to USTA League teams, sponsor the the following activities: </p>\r\n              <ul class=\"front-page-list\">\r\n                <li> Women\'s Interclub. </li>\r\n                <li> Men drop in every Mon/Wed/Fri at 12:00 pm. </li>\r\n                <li> Socials. </li>\r\n                <li> Drop in tennis is every Friday night at 6:45 pm conducted by the Cupertino Sports Center.</li>\r\n              </ul>  \r\n              \r\n              <p> <strong>  WOMEN\'S INTERCLUB </strong> <p>\r\n              <p> For those of you who have never played Women\'s Interclub, Interclub is a social/casual league where members from the Cupertino Tennis Club play with other clubs in the area. After playing, the group will enjoy lunch with the opponents. </p>  \r\n              <p> Interclub matches are played in the mornings, September through May with most of December off, and usually consist of four or five doubles matches. The playing level is usually between 3.0 and 4.0. There is no fee to play, and this is NOT a USTA sanctioned event.<p>\r\n              <p> The club now has three levels of women\'s interclub: 3.0, 3.5 and 4.0. &nbsp; If you are interested in playing, please contact the team captain(s) either directly or by clicking on their names for a current schedule of dates. </p>\r\n                <div class=\"table-responsive\">\r\n                  <table class=\"table table-hover table-bordered\">\r\n                      <thead>\r\n                          <tr class=\"success\">\r\n                               <th>Level</th>\r\n                               <th>Contact/Email</th>\r\n                          </tr>  \r\n                      </thead> \r\n                      <tbody>\r\n                          <tr>\r\n                               <th>3.0-3.5 level</th>\r\n                               <th><a href=\"mailto:womensinterclub30@cupertinotennisclub.org\"> Kweiping Wong </a></th>\r\n                          </tr>\r\n                           <tr>\r\n                               <th>3.5 level</th>\r\n                               <th><a href=\"mailto:womensinterclub35@cupertinotennisclub.org\"> Grace Haig </a></th>\r\n                          </tr>\r\n                           <tr>\r\n                               <th>4.0 level</th>\r\n                               <th><a href=\"mailto:womensinterclub40@cupertinotennisclub.org\"> Joan Hu </a></th>\r\n                          </tr>\r\n\r\n                      </tbody> \r\n                  </table>\r\n                </div>\r\n              <p> <strong> SOCIALS </strong> <p>\r\n              <p> Socials are scheduled throughout the year depending on court availability and interest. Your ideas and suggestions are always welcome, please contact Lili Occena at <a href=\"mailto:Socials@CupertinoTennisClub.org\">Socials</a>.</p>\r\n              <p> The Annual meeting is scheduled for early December each year. It is usually held off-site with pizza, drinks and dessert followed by--or prior to--the annual meeting and election of new board members. </p>\r\n              <p> More information prior to each event will be published in the Newsletter and on our Home Page. </p>\r\n              <p> Want to run, or help with, a social? Have questions? Contact the <a href=\"mailto:Socials@Cupertinotennisclub.org\">Socials Director</a>. </p>\r\n\r\n        </div>','Club Activities','','inherit','closed','closed','','45-revision-v1','','','2018-08-07 15:14:35','2018-08-07 22:14:35','',45,'https://ctc.cupertinotennisclub.org/45-revision-v1/',0,'revision','',0),(754,25,'2018-10-05 07:26:00','2018-10-05 14:26:00','[declaretoplay18_39doubles]','Adult 18-39 Doubles','','publish','closed','closed','','adult18-39doubles','','','2018-10-05 07:26:00','2018-10-05 14:26:00','',0,'https://ctc.cupertinotennisclub.org/?page_id=754',0,'page','',0),(755,25,'2018-10-05 07:26:00','2018-10-05 14:26:00','[declaretoplay18_39doubles]','Adult 18-39 Doubles','','inherit','closed','closed','','754-revision-v1','','','2018-10-05 07:26:00','2018-10-05 14:26:00','',754,'https://ctc.cupertinotennisclub.org/754-revision-v1/',0,'revision','',0),(756,25,'2018-10-05 07:28:25','2018-10-05 14:28:25','','total 18-39 doubles','','publish','closed','closed','','total18-39doubles','','','2018-10-05 07:28:25','2018-10-05 14:28:25','',0,'https://ctc.cupertinotennisclub.org/?page_id=756',0,'page','',0),(757,25,'2018-10-05 07:28:25','2018-10-05 14:28:25','','total 18-39 doubles','','inherit','closed','closed','','756-revision-v1','','','2018-10-05 07:28:25','2018-10-05 14:28:25','',756,'https://ctc.cupertinotennisclub.org/756-revision-v1/',0,'revision','',0),(758,25,'2018-10-05 12:43:00','2018-10-05 19:43:00','<div class=\"col-md-12\">\r\n<h1>Interested in playing on a USTA league team?</h1>\r\nPlease use the green buttons (below) to declare your intent to play in your intended league(s).\r\n\r\nYou may declare your intent to play on either <strong>one</strong> or <strong>two</strong> teams per league.\r\n\r\nThere are three team types at CTC:\r\n<ul class=\"front-page-list\">\r\n	<li><strong>Competitive</strong> - This team strives to win the league, and will predominantly play only the best players.</li>\r\n	<li><strong>Recreational</strong> - This team is composed of players who are not at the top of their level, but still enjoy good competition.\r\nThis team might also be composed of a group of friends who just enjoy playing with each other.</li>\r\n	<li><strong>Developmental</strong> - This team is composed mostly of players who are \"playing up\" at a level above their rating.</li>\r\n</ul>\r\n<strong> You have to be a registered member on this website in order to Declare Intent to play USTA. </strong>\r\n\r\n[buttons]\r\n\r\n<div class=\"col-md-12\">\r\n<h4>Check below to see your name, and every