 and other events.</p>\r\n<p><strong>Please note: </strong>You must have an ANNUAL (not monthly)  membership at CSC and be a current member of CTC prior to playing on a CTC USTA or Interclub team.</p>\r\n\r\n<p>Come on out to CSC and play some tennis!!! </p>\r\n\r\nHere are a few ways to get started with playing tennis and meeting people!\r\n<ul class=\"front-page-list\">\r\n	<li>DECLARE INTENT to play and join a Cupertino Tennis Team to play in a USTA League.</li>\r\n        <li>Participate in Womens Interclub.</li>\r\n	<li>Play mens drop-in tennis MWF at 10:00 AM.<span style=\"color: green;\">*</span></li>\r\n        <li>Watch for CTC Socials (coming soon). </li>\r\n        <li>Play drop-in tennis Friday nights 6:45 PM.<span style=\"color: green;\">*</span></li>\r\n	<li>Volunteer for one or more of the club\'s activities - a great way to meet new people and have a good time!</li>\r\n	\r\n</ul>\r\n<p class=\"small\"><span style=\"color: green;\">*</span>  Not a CTC activity.  CTC membership not required.</p>\r\n<address><strong>Cupertino Sports Center</strong>\r\n21111 Stevens Creek Blvd, Cupertino, CA 95014\r\n<abbr title=\"Phone\">P:</abbr> (408) 777-3160</address>\r\n<div class=\"thumbnail\"><iframe style=\"border: 0;\" src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3172.799658505789!2d-122.04275199999998!3d37.323572999999996!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x808fb44dc125cec7%3A0x9e30b79f6e4ecc9c!2sCupertino+Sports+Center!5e0!3m2!1sen!2sus!4v1440454038035\" width=\"100%\" height=\"300\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>\r\n<div class=\"col-md-4\">\r\n<div class=\"thumbnail sidebarright\"><a href=\"https://ctc.cupertinotennisclub.org/declaretoplay/\">\r\n<img class=\"img-responsive thumbnail sidebarimage\" src=\"https://ctc.cupertinotennisclub.org/wp-content/uploads/2015/08/mainbaner.jpg\" alt=\"Declare to Play USTA\" />\r\nDeclare to play USTA</a></div>\r\n<div class=\"thumbnail sidebarright\"><a href=\"https://ctc.cupertinotennisclub.org/?p=35\">\r\n<img class=\"img-responsive thumbnail sidebarimage\" src=\"https://ctc.cupertinotennisclub.org/wp-content/uploads/2015/08/membership.jpg\" alt=\"Membership Application\" />\r\nMembership Application</a></div>\r\n<div class=\"thumbnail sidebarright\"><a href=\"https://ctc.cupertinotennisclub.org/?p=45\">\r\n<img class=\"img-responsive thumbnail sidebarimage\" src=\"https://ctc.cupertinotennisclub.org/wp-content/uploads/2015/08/interclub.jpg\" alt=\"Interclub\" />\r\nInterclub</a></div>\r\n</div>','home','','inherit','closed','closed','','14-revision-v1','','','2018-10-24 15:09:05','2018-10-24 22:09:05','',14,'https://ctc.cupertinotennisclub.org/14-revision-v1/',0,'revision','',0),(761,25,'2018-10-24 15:10:11','2018-10-24 22:10:11','<div class=\"col-xs-12 col-md-12\">\r\n            <h1>CTC Activities</h1>\r\n              <p> The Cupertino Tennis Club in addition to USTA League teams, sponsor the the following activities: </p>\r\n              <ul class=\"front-page-list\">\r\n                <li> Women\'s Interclub. </li>\r\n                <li> Socials. </li>\r\n              </ul>  \r\n              \r\n              <p> <strong>  WOMEN\'S INTERCLUB </strong> <p>\r\n              <p> For those of you who have never played Women\'s Interclub, Interclub is a social/casual league where members from the Cupertino Tennis Club play with other clubs in the area. After playing, the group will enjoy lunch with the opponents. </p>  \r\n              <p> Interclub matches are played in the mornings, September through May with most of December off, and usually consist of four or five doubles matches. The playing level is usually between 3.0 and 4.0. There is no fee to play, and this is NOT a USTA sanctioned event.<p>\r\n              <p> The club now has three levels of women\'s interclub: 3.0, 3.5 and 4.0. &nbsp; If you are interested in playing, please contact the team captain(s) either directly or by clickin